import assert from 'node:assert/strict'
import test from 'node:test'

import { QuickJSLib } from '../../../scripts/QuickJSLib'
import { parseSource } from '../../ast/parser'
import { AtomTable } from '../atom-table'
import { BytecodeCompiler } from '../emitter'
import { OPCODE_BY_CODE, TEMP_OPCODE_BY_CODE } from '../../env'

const decodeOpcodes = (bytes: Uint8Array): string[] => {
  const ops: string[] = []
  let offset = 0
  while (offset < bytes.length) {
    const opcode = bytes[offset]
    const def = TEMP_OPCODE_BY_CODE[opcode] ?? OPCODE_BY_CODE[opcode]
    if (!def) throw new Error(`Unknown opcode: ${opcode}`)
    ops.push(def.id)
    offset += def.size
  }
  return ops
}

const extractWasmOpcodes = async (source: string): Promise<string[]> => {
  const bytes = await QuickJSLib.compileSourceAsScript(source, 'literal.js')
  const dump = await QuickJSLib.dumpBytesToString(bytes)
  const lines = dump.split('\n')
  const ops: string[] = []
  let inOpcodes = false

  for (const line of lines) {
    if (!inOpcodes) {
      if (/opcodes \(\d+ bytes\):/.test(line)) {
        inOpcodes = true
      }
      continue
    }

    const match = line.match(/^\s*\d+\s+([a-z0-9_]+)/i)
    if (match) {
      ops.push(match[1])
      continue
    }

    if (line.trim() === '' && ops.length > 0) break
  }

  return ops
}

const normalizeOpcodes = (ops: string[]): string[] => {
  const ignore = new Set([
    'line_num',
    'label',
    'undefined',
    'get_loc',
    'get_loc0',
    'get_loc1',
    'get_loc2',
    'get_loc3',
    'put_loc',
    'put_loc0',
    'put_loc1',
    'put_loc2',
    'put_loc3',
    'set_loc0',
    'set_loc1',
    'set_loc2',
    'set_loc3',
    'set_loc',
    'return',
    'return_undef',
  ])

  const shortMap: Record<string, string> = {
    push_0: 'push_i32',
    push_1: 'push_i32',
    push_2: 'push_i32',
    push_3: 'push_i32',
    push_i8: 'push_i32',
    push_const8: 'push_const',
    fclosure8: 'fclosure',
    if_true8: 'if_true',
    if_false8: 'if_false',
    goto8: 'goto',
    call2: 'call',
  }

  return ops
    .map(op => shortMap[op] ?? op)
    .filter(op => !ignore.has(op))
}

const compileEmitterOpcodes = (source: string): string[] => {
  const atomTable = new AtomTable()
  const node = parseSource(source, { fileName: 'literal.ts' })
  const compiler = new BytecodeCompiler({ atomTable })
  const buffer = compiler.compile(node)
  return decodeOpcodes(buffer.toUint8Array())
}

const assertLiteralAligned = async (source: string) => {
  const ours = normalizeOpcodes(compileEmitterOpcodes(source))
  const wasm = normalizeOpcodes(await extractWasmOpcodes(source))
  assert.deepEqual(ours, wasm)
}

test('literals: array literal aligns with wasm', async () => {
  await assertLiteralAligned('[1, 2];')
})

test('literals: object literal aligns with wasm', async () => {
  await assertLiteralAligned('({ a: 1, b: 2 });')
})

test('literals: object literal computed aligns with wasm', async () => {
  await assertLiteralAligned('({ [key]: 1 });')
})

test('literals: object literal shorthand aligns with wasm', async () => {
  await assertLiteralAligned('({ a });')
})

test('literals: array literal spread aligns with wasm', async () => {
  await assertLiteralAligned('[...arr, 1];')
})

test('literals: object literal spread aligns with wasm', async () => {
  await assertLiteralAligned('({ ...obj, a: 1 });')
})

test('literals: object literal __proto__ aligns with wasm', async () => {
  await assertLiteralAligned('({ __proto__: proto });')
})

import { spawnSync } from 'node:child_process'
import { existsSync, readFileSync } from 'node:fs'
import { resolve, relative, basename } from 'node:path'
import { pathToFileURL } from 'node:url'

interface Atom {
  id: number
  key: string
}

interface OpcodeMeta {
  name: string
  code: number
  nPop: number
  nPush: number
  fmt: number
  size: number
  isTemp: boolean
}

interface StringArray {
  size: () => number
  get: (index: number) => string
  push_back: (str: string) => void
}

interface BytecodeTag {
  id: number
  name: string
}

interface WasmInstance {
  runWithBinary: (input: Uint8Array, args: StringArray) => void
  dumpWithBinary: (input: Uint8Array, args: StringArray) => string
  compile: (source: string, sourcePath: string, args: StringArray) => Uint8Array
  compileScript: (source: string, sourcePath: string, args: StringArray) => Uint8Array
  getBytecodeVersion: () => number
  getFirstAtomId: () => number
  getAtoms: () => Atom[]
  getEnvironmentAtoms: () => Atom[]
  getOpcodes: () => OpcodeMeta[]
  getBytecodeTags: () => BytecodeTag[]
  getCompileFlags: () => number
  getCompileEnums: () => Record<string, number>
  getParseFunctionEnums: () => Array<{ id: number; name: string }>
  getParseExportEnums: () => Array<{ id: number; name: string }>
  getVarKindEnums: () => Array<{ id: number; name: string }>
  getBlockEnvLayout: () => Array<{ name: string; offset: number; size: number }>
  getFunctionBytecodeLayout: () => Array<{ name: string; offset: number; size: number }>
  getModuleDefLayout: () => Array<{ name: string; offset: number; size: number }>
  getFunctionDefLayout: () => Array<{ name: string; offset: number; size: number }>
  getVarDefLayout: () => Array<{ name: string; offset: number; size: number }>
  getVarScopeLayout: () => Array<{ name: string; offset: number; size: number }>
  getClosureVarLayout: () => Array<{ name: string; offset: number; size: number }>
  getGlobalVarLayout: () => Array<{ name: string; offset: number; size: number }>
  getImportEntryLayout: () => Array<{ name: string; offset: number; size: number }>
  getExportEntryLayout: () => Array<{ name: string; offset: number; size: number }>
  getStarExportEntryLayout: () => Array<{ name: string; offset: number; size: number }>
  getReqModuleEntryLayout: () => Array<{ name: string; offset: number; size: number }>
  getLineCol: (input: string, position: number) => { line: number; column: number }
  getLineColCached: (
    input: string,
    position: number,
    cachePtr: number,
    cacheLine: number,
    cacheColumn: number,
  ) => { ptr: number; line: number; column: number }
  getBlockManagerScenario: () => { entries: { size: () => number; get: (index: number) => any }; top: number }
  getModuleScenario: () => { imports: { size: () => number; get: (index: number) => any }; exports: { size: () => number; get: (index: number) => any } }
  getSerializerScenario: () => { size: () => number; get: (index: number) => number }
  getCompilerScenario: () => { size: () => number; get: (index: number) => number }
  optimizePeephole: (input: Uint8Array) => { size: () => number; get: (index: number) => number }
  optimizeShortOpcodes: (input: Uint8Array) => { size: () => number; get: (index: number) => number }
  optimizeDeadCode: (input: Uint8Array) => { size: () => number; get: (index: number) => number }
}

export class QuickJSLib {
  //  any  Emscripten 
  static WasmInstance: any | null = null
  private static rebuildAttempted = false

  private static readonly requiredBindings = [
    'getConstantPoolAddResult',
    'getInlineCacheAddResult',
    'getLabelManagerScenario',
    'getScopeManagerScenario',
    'getBlockManagerScenario',
    'getModuleScenario',
    'getSerializerScenario',
    'getCompilerScenario',
    'optimizePeephole',
    'optimizeShortOpcodes',
    'optimizeDeadCode',
  ] as const

  private static outputHandlers: {
    print: (text: string) => void
    printErr: (text: string) => void
  } = {
    print: (text: string) => console.log(text),
    printErr: (text: string) => console.error(text),
  }

  static setOutputHandlers(handlers: Partial<typeof QuickJSLib.outputHandlers>) {
    QuickJSLib.outputHandlers = {
      ...QuickJSLib.outputHandlers,
      ...handlers,
    }
  }

  static async withCapturedOutput<T>(fn: () => Promise<T> | T): Promise<{ result: T; stdout: string[]; stderr: string[] }> {
    const stdout: string[] = []
    const stderr: string[] = []

    const prev = QuickJSLib.outputHandlers
    QuickJSLib.setOutputHandlers({
      print: (text) => stdout.push(String(text ?? '')),
      printErr: (text) => stderr.push(String(text ?? '')),
    })

    try {
      const result = await fn()
      return { result, stdout, stderr }
    } finally {
      QuickJSLib.outputHandlers = prev
    }
  }

  static ensureWasmBuilt (forceRebuild = false) {
    const path = resolve(process.cwd(), 'third_party/QuickJS/wasm/output/quickjs_wasm.js')
    const configPath = resolve(process.cwd(), 'third_party/QuickJS/wasm/output/quickjs_wasm.build-config.json')
    const wantTrace = process.env.QTS_TRACE_ENABLED === '1'
    const wantTraceOverride = Boolean(
      process.env.QTS_TRACE_LEVEL ||
      process.env.QTS_TRACE_EMIT ||
      process.env.QTS_TRACE_VARIABLE ||
      process.env.QTS_TRACE_CLOSURE ||
      process.env.QTS_TRACE_LABEL ||
      process.env.QTS_TRACE_STACK ||
      process.env.QTS_TRACE_PC2LINE ||
      process.env.QTS_TRACE_SCOPE ||
      process.env.QTS_TRACE_ASSIGN,
    )

    const desiredEnabled = (wantTrace || wantTraceOverride) ? 1 : 0
    const desiredLevel = (() => {
      const v = process.env.QTS_TRACE_LEVEL
      if (v === '1' || v === '2' || v === '3') return Number(v)
      return 1
    })()
    const desiredCategory = (envKey: string): 0 | 1 => {
      if (!desiredEnabled) return 0
      const v = process.env[envKey]
      if (v === '0') return 0
      if (v === '1') return 1
      return 1
    }
    const desired = {
      enabled: desiredEnabled,
      level: desiredLevel,
      categories: {
        EMIT: desiredCategory('QTS_TRACE_EMIT'),
        VARIABLE: desiredCategory('QTS_TRACE_VARIABLE'),
        CLOSURE: desiredCategory('QTS_TRACE_CLOSURE'),
        LABEL: desiredCategory('QTS_TRACE_LABEL'),
        STACK: desiredCategory('QTS_TRACE_STACK'),
        PC2LINE: desiredCategory('QTS_TRACE_PC2LINE'),
        SCOPE: desiredCategory('QTS_TRACE_SCOPE'),
        ASSIGN: desiredCategory('QTS_TRACE_ASSIGN'),
      },
    }

    if (!forceRebuild && existsSync(path) && existsSync(configPath)) {
      try {
        const cfg = JSON.parse(readFileSync(configPath, 'utf8'))
        const built = cfg?.qtsTrace
        const same =
          built?.enabled === desired.enabled &&
          built?.level === desired.level &&
          built?.categories?.EMIT === desired.categories.EMIT &&
          built?.categories?.VARIABLE === desired.categories.VARIABLE &&
          built?.categories?.CLOSURE === desired.categories.CLOSURE &&
          built?.categories?.LABEL === desired.categories.LABEL &&
          built?.categories?.STACK === desired.categories.STACK &&
          built?.categories?.PC2LINE === desired.categories.PC2LINE &&
          built?.categories?.SCOPE === desired.categories.SCOPE &&
          built?.categories?.ASSIGN === desired.categories.ASSIGN
        if (same) return path
      } catch {
        // 
      }
    }

    if (!forceRebuild && existsSync(path) && desiredEnabled === 0 && !existsSync(configPath)) {
      //  marker non-trace
      return path
    }

    const buildScript = resolve(process.cwd(), 'scripts/buildWasm.ts')

    const args: string[] = ['tsx', buildScript]
    if (wantTrace || wantTraceOverride) {
      args.push('--trace')
      const lvl = process.env.QTS_TRACE_LEVEL
      if (lvl === '1' || lvl === '2' || lvl === '3') {
        args.push('--trace-level', lvl)
      }
    }

    const r = spawnSync('npx', args, { stdio: 'inherit', encoding: 'utf8' })

    if (r.status !== 0) return null
    return existsSync(path) ? path : null
  }

  private static hasRequiredBindings(instance: any): boolean {
    const binding = instance?.QuickJSBinding
    if (!binding) return false
    if (typeof instance?.Int32Array !== 'function') return false
    return QuickJSLib.requiredBindings.every(name => typeof binding[name] === 'function')
  }

  private static async loadWasmInstance(path: string, cacheBust = false): Promise<any> {
    const url = pathToFileURL(path)
    const importPath = cacheBust ? `${url.href}?t=${Date.now()}` : url.href
    const WasmModule: any = await import(importPath)
    return WasmModule.default({
      print: (text: string) => QuickJSLib.outputHandlers.print(text),
      printErr: (text: string) => QuickJSLib.outputHandlers.printErr(text),
    })
  }

  static getWasmInstance = async (): Promise<any> => {
    if (QuickJSLib.WasmInstance) return QuickJSLib.WasmInstance

    const path = QuickJSLib.ensureWasmBuilt()
    if (!path) throw new Error('QuickJS wasm binding not available')

    let instance = await QuickJSLib.loadWasmInstance(path)

    if (!QuickJSLib.hasRequiredBindings(instance) && !QuickJSLib.rebuildAttempted) {
      QuickJSLib.rebuildAttempted = true
      const rebuiltPath = QuickJSLib.ensureWasmBuilt(true)
      if (!rebuiltPath) throw new Error('QuickJS wasm binding rebuild failed')
      instance = await QuickJSLib.loadWasmInstance(rebuiltPath, true)
    }

    if (!QuickJSLib.hasRequiredBindings(instance)) {
      throw new Error('QuickJS wasm binding missing required interfaces. Please rebuild QuickJS wasm.')
    }

    QuickJSLib.WasmInstance = instance
    return QuickJSLib.WasmInstance as WasmInstance
  }

  static async getQuickJSModule(): Promise<any> {
    return this.getWasmInstance()
  }

  static getCompileFlags = async (): Promise<number> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    return WasmInstance.QuickJSBinding.getCompileOptions()
  }

  static getCompileFlagEnums = async (): Promise<Record<string, number>> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const enums: Record<string, number> = {}

    enums['COMPILE_FLAG_NONE'] = WasmInstance.CompileFlags.COMPILE_FLAG_NONE.value
    enums['COMPILE_FLAG_DUMP'] = WasmInstance.CompileFlags.COMPILE_FLAG_DUMP.value
    enums['COMPILE_FLAG_BIGNUM'] = WasmInstance.CompileFlags.COMPILE_FLAG_BIGNUM.value
    enums['COMPILE_FLAG_SHORT_OPCODES'] = WasmInstance.CompileFlags.COMPILE_FLAG_SHORT_OPCODES.value

    return enums
  }

  static getLineCol = async (input: string, position: number): Promise<{ line: number; column: number }> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const result = WasmInstance.QuickJSBinding.getLineCol(input, position)
    return { line: result.line, column: result.column }
  }

  static getLineColCached = async (
    input: string,
    position: number,
    cache: { ptr: number; line: number; column: number },
  ): Promise<{ ptr: number; line: number; column: number }> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const result = WasmInstance.QuickJSBinding.getLineColCached(
      input,
      position,
      cache.ptr,
      cache.line,
      cache.column,
    )
    return { ptr: result.ptr, line: result.line, column: result.column }
  }

  static getConstantPoolAddResult = async (values: number[]): Promise<{ indices: number[]; count: number }> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const vec = new WasmInstance.Int32Array()
    for (const value of values) {
      vec.push_back(value)
    }
    const result = WasmInstance.QuickJSBinding.getConstantPoolAddResult(vec)
    const indices: number[] = []
    for (let i = 0; i < result.indices.size(); i++) {
      indices.push(result.indices.get(i))
    }
    return { indices, count: result.count }
  }

  static getInlineCacheAddResult = async (atoms: number[]): Promise<{ results: number[]; count: number }> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const vec = new WasmInstance.Int32Array()
    for (const atom of atoms) {
      vec.push_back(atom)
    }
    const result = WasmInstance.QuickJSBinding.getInlineCacheAddResult(vec)
    const results: number[] = []
    for (let i = 0; i < result.results.size(); i++) {
      results.push(result.results.get(i))
    }
    return { results, count: result.count }
  }

  static getLabelManagerScenario = async (): Promise<{ bytecodeSize: number; slots: Array<{ refCount: number; pos: number; pos2: number; addr: number; firstReloc: number }> }> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const result = WasmInstance.QuickJSBinding.getLabelManagerScenario()
    const slots: Array<{ refCount: number; pos: number; pos2: number; addr: number; firstReloc: number }> = []
    for (let i = 0; i < result.slots.size(); i++) {
      const slot = result.slots.get(i)
      slots.push({ refCount: slot.refCount, pos: slot.pos, pos2: slot.pos2, addr: slot.addr, firstReloc: slot.firstReloc })
    }
    return { bytecodeSize: result.bytecodeSize, slots }
  }

  static getScopeManagerScenario = async (
    atomA: number,
    atomB: number,
    atomC: number,
    kindA: number,
    kindB: number,
    kindC: number,
  ): Promise<{ vars: Array<{ varName: number; scopeLevel: number; scopeNext: number; varKind: number }>; scopes: Array<{ parent: number; first: number }>; scopeLevel: number; scopeFirst: number }> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const result = WasmInstance.QuickJSBinding.getScopeManagerScenario(atomA, atomB, atomC, kindA, kindB, kindC)
    const vars: Array<{ varName: number; scopeLevel: number; scopeNext: number; varKind: number }> = []
    for (let i = 0; i < result.vars.size(); i++) {
      const item = result.vars.get(i)
      vars.push({ varName: item.varName, scopeLevel: item.scopeLevel, scopeNext: item.scopeNext, varKind: item.varKind })
    }
    const scopes: Array<{ parent: number; first: number }> = []
    for (let i = 0; i < result.scopes.size(); i++) {
      const item = result.scopes.get(i)
      scopes.push({ parent: item.parent, first: item.first })
    }
    return { vars, scopes, scopeLevel: result.scopeLevel, scopeFirst: result.scopeFirst }
  }

  static getBlockManagerScenario = async (): Promise<{ entries: Array<{ prev: number; labelName: number; labelBreak: number; labelCont: number; dropCount: number; labelFinally: number; scopeLevel: number; hasIterator: number; isRegularStmt: number }>; top: number }> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const result = WasmInstance.QuickJSBinding.getBlockManagerScenario()
    const entries: Array<{ prev: number; labelName: number; labelBreak: number; labelCont: number; dropCount: number; labelFinally: number; scopeLevel: number; hasIterator: number; isRegularStmt: number }> = []
    for (let i = 0; i < result.entries.size(); i++) {
      const item = result.entries.get(i)
      entries.push({
        prev: item.prev,
        labelName: item.labelName,
        labelBreak: item.labelBreak,
        labelCont: item.labelCont,
        dropCount: item.dropCount,
        labelFinally: item.labelFinally,
        scopeLevel: item.scopeLevel,
        hasIterator: item.hasIterator,
        isRegularStmt: item.isRegularStmt,
      })
    }
    return { entries, top: result.top }
  }

  static getModuleScenario = async (): Promise<{ imports: Array<{ moduleName: string; importName: string; isStar: number }>; exports: Array<{ localName: string; exportName: string; exportType: number }> }> => {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const result = WasmInstance.QuickJSBinding.getModuleScenario()
    const imports: Array<{ moduleName: string; importName: string; isStar: number }> = []
    const exports: Array<{ localName: string; exportName: string; exportType: number }> = []
    for (let i = 0; i < result.imports.size(); i++) {
      const item = result.imports.get(i)
      imports.push({ moduleName: item.moduleName, importName: item.importName, isStar: item.isStar })
    }
    for (let i = 0; i < result.exports.size(); i++) {
      const item = result.exports.get(i)
      exports.push({ localName: item.localName, exportName: item.exportName, exportType: item.exportType })
    }
    return { imports, exports }
  }

  static async getSerializerScenario(): Promise<Uint8Array> {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const result = WasmInstance.QuickJSBinding.getSerializerScenario()
    return QuickJSLib.toUint8Array(result)
  }

  static async getCompilerScenario(): Promise<Uint8Array> {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const result = WasmInstance.QuickJSBinding.getCompilerScenario()
    return QuickJSLib.toUint8Array(result)
  }

  private static toUint8Array(result: { size: () => number; get: (index: number) => number }): Uint8Array {
    const out = new Uint8Array(result.size())
    for (let i = 0; i < out.length; i += 1) {
      out[i] = result.get(i)
    }
    return out
  }

  private static toStringArray(instance: any, items: string[] = []): any {
    const vec = new instance.StringArray()
    for (const item of items) {
      vec.push_back(item)
    }
    return vec
  }

  private static toUint8Vector(instance: any, input: Uint8Array): any {
    const vec = new instance.Uint8Array()
    for (const byte of input) {
      vec.push_back(byte)
    }
    return vec
  }

  static async optimizePeephole(bytes: Uint8Array): Promise<Uint8Array> {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const vec = QuickJSLib.toUint8Vector(WasmInstance, bytes)
    const result = WasmInstance.QuickJSBinding.optimizePeephole(vec)
    return QuickJSLib.toUint8Array(result)
  }

  static async optimizeShortOpcodes(bytes: Uint8Array): Promise<Uint8Array> {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const vec = QuickJSLib.toUint8Vector(WasmInstance, bytes)
    const result = WasmInstance.QuickJSBinding.optimizeShortOpcodes(vec)
    return QuickJSLib.toUint8Array(result)
  }

  static async optimizeDeadCode(bytes: Uint8Array): Promise<Uint8Array> {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const vec = QuickJSLib.toUint8Vector(WasmInstance, bytes)
    const result = WasmInstance.QuickJSBinding.optimizeDeadCode(vec)
    return QuickJSLib.toUint8Array(result)
  }

  static async runWithBinaryPath(binaryPath: string) {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const source = readFileSync(binaryPath)

    const input = new WasmInstance.Uint8Array()
    for (let i = 0; i < source.length; i++) {
      input.push_back(source[i])
    }

    WasmInstance.QuickJSBinding.runWithBinary(input, new WasmInstance.StringArray())
  }

  static async runBytes(bytes: Uint8Array | Buffer, modules: string[] = []) {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const input = new WasmInstance.Uint8Array()
    for (let i = 0; i < bytes.length; i++) input.push_back(bytes[i])
    WasmInstance.QuickJSBinding.runWithBinary(input, QuickJSLib.toStringArray(WasmInstance, modules))
  }

  static async dumpWithBinaryPath(binaryPath: string) {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const source = readFileSync(binaryPath)

    const input = new WasmInstance.Uint8Array()
    for (let i = 0; i < source.length; i++) {
      input.push_back(source[i])
    }

    const text = WasmInstance.QuickJSBinding.dumpWithBinary(input, new WasmInstance.StringArray())
    console.log(String(text || ''))
  }

  static async dumpBytesToString(bytes: Uint8Array | Buffer): Promise<string> {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const input = new WasmInstance.Uint8Array()
    for (let i = 0; i < bytes.length; i++) input.push_back(bytes[i])
    const text = WasmInstance.QuickJSBinding.dumpWithBinary(input, new WasmInstance.StringArray())
    return String(text || '')
  }

  static async getCompileEnums(): Promise<Record<string, number>> {
    const WasmInstance = await QuickJSLib.getWasmInstance()
    const enums: Record<string, number> = {}

    enums['COMPILE_FLAG_NONE'] = WasmInstance.CompileFlags.COMPILE_FLAG_NONE.value
