      const { propAtom, targetAtom } = this.getObjectBindingAtoms(element, context)
      if (rest) {
        context.bytecode.emitOp(Opcode.OP_swap)
        context.bytecode.emitOp(Opcode.OP_null)
        context.bytecode.emitOp(Opcode.OP_define_field)
        context.bytecode.emitAtom(propAtom)
        context.bytecode.emitOp(Opcode.OP_swap)
      }
      if (useGetField2) {
        context.bytecode.emitOp(Opcode.OP_get_field2)
        context.bytecode.emitAtom(propAtom)
      } else {
        context.bytecode.emitOp(Opcode.OP_dup)
        context.bytecode.emitOp(Opcode.OP_get_field)
        context.bytecode.emitAtom(propAtom)
      }
      if (element.initializer) {
        this.emitDefaultInitializer(element.initializer, context, emitExpression)
      }
      this.emitBindingInit(targetAtom, context)
    }

    if (rest) {
      if (!ts.isIdentifier(rest.name)) {
        throw new Error(' rest ')
      }
      context.bytecode.emitOp(Opcode.OP_object)
      context.bytecode.emitOp(Opcode.OP_copy_data_properties)
      context.bytecode.emitU8(COPY_DATA_PROPERTIES_FLAGS_DEPTH0)
      this.emitBindingInit(context.getAtom(rest.name.text), context)
    }

    context.bytecode.emitOp(Opcode.OP_drop)
    if (rest) {
      context.bytecode.emitOp(Opcode.OP_drop)
    }
  }

  private emitArrayBindingFromValue(
    pattern: ts.ArrayBindingPattern,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
  ) {
    const { elements, rest } = this.splitArrayBinding(pattern)
    context.bytecode.emitOp(Opcode.OP_for_of_start)

    for (const element of elements) {
      if (!element) continue
      if (element.kind === ts.SyntaxKind.OmittedExpression) {
        context.bytecode.emitOp(Opcode.OP_for_of_next)
        context.bytecode.emitU8(0)
        context.bytecode.emitOp(Opcode.OP_drop)
        context.bytecode.emitOp(Opcode.OP_drop)
        continue
      }
      if (!ts.isBindingElement(element) || !ts.isIdentifier(element.name)) {
        throw new Error('')
      }
      const atom = context.getAtom(element.name.text)
      context.bytecode.emitOp(Opcode.OP_for_of_next)
      context.bytecode.emitU8(0)
      context.bytecode.emitOp(Opcode.OP_drop)
      if (element.initializer) {
        this.emitDefaultInitializer(element.initializer, context, emitExpression)
      }
      this.emitBindingInit(atom, context)
    }

    if (rest) {
      if (!ts.isIdentifier(rest.name)) {
        throw new Error(' rest ')
      }
      this.emitSpreadArrayFromIterator(context, 0)
      this.emitBindingInit(context.getAtom(rest.name.text), context)
    }

    context.bytecode.emitOp(Opcode.OP_iterator_close)
  }

  private emitDefaultInitializer(
    initializer: ts.Expression,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
  ) {
    context.bytecode.emitOp(Opcode.OP_dup)
    context.bytecode.emitOp(Opcode.OP_is_undefined)
    const skipLabel = context.labels.emitGoto(Opcode.OP_if_false, -1)
    context.bytecode.emitOp(Opcode.OP_drop)
    emitExpression(initializer, context)
    context.labels.emitLabel(skipLabel)
  }

  private splitObjectBinding(pattern: ts.ObjectBindingPattern) {
    const elements: ts.BindingElement[] = []
    let rest: ts.BindingElement | undefined
    pattern.elements.forEach((element, index) => {
      if (!element) return
      if (element.dotDotDotToken) {
        if (rest) {
          throw new Error(' rest ')
        }
        if (index !== pattern.elements.length - 1) {
          throw new Error(' rest ')
        }
        rest = element
        return
      }
      elements.push(element)
    })
    return { elements, rest }
  }

  private splitArrayBinding(pattern: ts.ArrayBindingPattern) {
    const elements: Array<ts.ArrayBindingElement> = []
    let rest: ts.BindingElement | undefined
    pattern.elements.forEach((element, index) => {
      if (!element) return
      if (ts.isBindingElement(element) && element.dotDotDotToken) {
        if (rest) {
          throw new Error(' rest ')
        }
        if (index !== pattern.elements.length - 1) {
          throw new Error(' rest ')
        }
        rest = element
        return
      }
      elements.push(element)
    })
    return { elements, rest }
  }

  private emitSpreadArrayFromIterator(context: EmitterContext, depth: number) {
    const nextLabel = context.labels.newLabel()
    const doneLabel = context.labels.newLabel()

    context.bytecode.emitOp(Opcode.OP_array_from)
    context.bytecode.emitU16(0)
    context.bytecode.emitOp(Opcode.OP_push_i32)
    context.bytecode.emitU32(0)

    context.labels.emitLabel(nextLabel)
    context.bytecode.emitOp(Opcode.OP_for_of_next)
    context.bytecode.emitU8(2 + depth)
    context.labels.emitGoto(Opcode.OP_if_true, doneLabel)
    context.bytecode.emitOp(Opcode.OP_define_array_el)
    context.bytecode.emitOp(Opcode.OP_inc)
    context.labels.emitGoto(Opcode.OP_goto, nextLabel)

    context.labels.emitLabel(doneLabel)
    context.bytecode.emitOp(Opcode.OP_drop)
    context.bytecode.emitOp(Opcode.OP_drop)
  }
  private emitObjectAssignment(
    pattern: ts.ObjectLiteralExpression,
    right: ts.Expression,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
  ) {
    const assignLabel = context.labels.newLabel()
    const getLabel = context.labels.newLabel()
    const endLabel = context.labels.newLabel()

    context.labels.emitGoto(Opcode.OP_goto, getLabel)
    context.labels.emitLabel(assignLabel)

    context.bytecode.emitOp(Opcode.OP_dup)
    context.bytecode.emitOp(Opcode.OP_to_object)

    for (const prop of pattern.properties) {
      const { propAtom, targetAtom } = this.getObjectLiteralAtoms(prop, context)
      context.bytecode.emitOp(Opcode.OP_dup)
      context.bytecode.emitOp(Opcode.OP_make_var_ref)
      context.bytecode.emitAtom(targetAtom)
      context.bytecode.emitOp(Opcode.OP_rot3l)
      context.bytecode.emitOp(Opcode.OP_get_field)
      context.bytecode.emitAtom(propAtom)
      context.bytecode.emitOp(Opcode.OP_put_ref_value)
    }

    context.bytecode.emitOp(Opcode.OP_drop)
    context.labels.emitGoto(Opcode.OP_goto, endLabel)

    context.labels.emitLabel(getLabel)
    emitExpression(right, context)
    context.labels.emitGoto(Opcode.OP_goto, assignLabel)

    context.labels.emitLabel(endLabel)
  }

  private emitArrayAssignment(
    pattern: ts.ArrayLiteralExpression,
    right: ts.Expression,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
  ) {
    const assignLabel = context.labels.newLabel()
    const getLabel = context.labels.newLabel()
    const endLabel = context.labels.newLabel()

    context.labels.emitGoto(Opcode.OP_goto, getLabel)
    context.labels.emitLabel(assignLabel)

    context.bytecode.emitOp(Opcode.OP_dup)
    context.bytecode.emitOp(Opcode.OP_for_of_start)

    for (const element of pattern.elements) {
      if (ts.isOmittedExpression(element)) {
        continue
      }
      if (!ts.isIdentifier(element)) {
        throw new Error('')
      }
      const atom = context.getAtom(element.text)
      context.bytecode.emitOp(Opcode.OP_make_var_ref)
      context.bytecode.emitAtom(atom)
      context.bytecode.emitOp(Opcode.OP_for_of_next)
      context.bytecode.emitU8(2)
      context.bytecode.emitOp(Opcode.OP_drop)
      context.bytecode.emitOp(Opcode.OP_put_ref_value)
    }

    context.bytecode.emitOp(Opcode.OP_iterator_close)
    context.labels.emitGoto(Opcode.OP_goto, endLabel)

    context.labels.emitLabel(getLabel)
    emitExpression(right, context)
    context.labels.emitGoto(Opcode.OP_goto, assignLabel)

    context.labels.emitLabel(endLabel)
  }

  private emitBindingInit(atom: number, context: EmitterContext) {
    const scopeLevel = context.scopes.scopeLevel
    if (scopeLevel >= 0) {
      const localIdx = context.scopes.findVarInScope(atom, scopeLevel)
      if (localIdx >= 0) {
        context.bytecode.emitOp(Opcode.OP_put_loc)
        context.bytecode.emitU16(localIdx)
        return
      }
    }
    context.bytecode.emitOp(Opcode.OP_put_var_init)
    context.bytecode.emitAtom(atom)
  }

  private getObjectBindingAtoms(
    element: ts.BindingElement,
    context: EmitterContext,
  ): { propAtom: number; targetAtom: number } {
    if (!ts.isIdentifier(element.name)) {
      throw new Error('')
    }

    if (!element.propertyName) {
      const atom = context.getAtom(element.name.text)
      return { propAtom: atom, targetAtom: atom }
    }

    if (ts.isIdentifier(element.propertyName)) {
      return {
        propAtom: context.getAtom(element.propertyName.text),
        targetAtom: context.getAtom(element.name.text),
      }
    }

    throw new Error('')
  }

  private getObjectLiteralAtoms(
    prop: ts.ObjectLiteralElementLike,
    context: EmitterContext,
  ): { propAtom: number; targetAtom: number } {
    if (ts.isPropertyAssignment(prop)) {
      if (!ts.isIdentifier(prop.name) || !ts.isIdentifier(prop.initializer)) {
        throw new Error('')
      }
      return {
        propAtom: context.getAtom(prop.name.text),
        targetAtom: context.getAtom(prop.initializer.text),
      }
    }

    if (ts.isShorthandPropertyAssignment(prop)) {
      const atom = context.getAtom(prop.name.text)
      return { propAtom: atom, targetAtom: atom }
    }

    throw new Error('')
  }
}

import ts from 'typescript'

import {
  COPY_DATA_PROPERTIES_OPERAND_SPREAD,
  OP_DEFINE_METHOD_ENUMERABLE,
  OP_DEFINE_METHOD_GETTER,
  OP_DEFINE_METHOD_METHOD,
  OP_DEFINE_METHOD_SETTER,
  Opcode,
} from '../env'
import type { EmitterContext } from './emitter'
import type { ExpressionEmitterFn } from './assignment'
import { FunctionEmitter } from './functions'

/**
 * /
 *
 * @source QuickJS/src/core/parser.c:2928-3042
 * @source QuickJS/src/core/parser.c:3760-3885
 * @see js_parse_array_literal
 * @see js_parse_object_literal
 */
export class LiteralEmitter {
  private functionEmitter = new FunctionEmitter()

  /**
   * @source QuickJS/src/core/parser.c:2928-3042
   * @see js_parse_array_literal
   */
  emitArrayLiteral(node: ts.ArrayLiteralExpression, context: EmitterContext, emitExpression: ExpressionEmitterFn) {
    const elements = node.elements
    const hasSpread = elements.some(element => ts.isSpreadElement(element))
    const hasHole = elements.some(element => element.kind === ts.SyntaxKind.OmittedExpression)

    if (!hasSpread && !hasHole) {
      for (const element of elements) {
        emitExpression(element as ts.Expression, context)
      }
      context.bytecode.emitOp(Opcode.OP_array_from)
      context.bytecode.emitU16(elements.length)
      return
    }

    if (hasSpread) {
      let prefixCount = 0
      while (prefixCount < elements.length) {
        const element = elements[prefixCount]
        if (ts.isSpreadElement(element) || element.kind === ts.SyntaxKind.OmittedExpression) {
          break
        }
        prefixCount += 1
      }

      if (prefixCount > 0) {
        for (let i = 0; i < prefixCount; i += 1) {
          emitExpression(elements[i] as ts.Expression, context)
        }
        context.bytecode.emitOp(Opcode.OP_array_from)
        context.bytecode.emitU16(prefixCount)
      } else {
        context.bytecode.emitOp(Opcode.OP_array_from)
        context.bytecode.emitU16(0)
      }

      context.bytecode.emitOp(Opcode.OP_push_i32)
      context.bytecode.emitU32(prefixCount)

      let trailingHole = false
      for (let i = prefixCount; i < elements.length; i += 1) {
        const element = elements[i]
        if (ts.isSpreadElement(element)) {
          trailingHole = false
          emitExpression(element.expression, context)
          context.bytecode.emitOp(Opcode.OP_append)
          continue
        }

        if (element.kind === ts.SyntaxKind.OmittedExpression) {
          trailingHole = true
          context.bytecode.emitOp(Opcode.OP_inc)
          continue
        }

        trailingHole = false
        emitExpression(element as ts.Expression, context)
        context.bytecode.emitOp(Opcode.OP_define_array_el)
        context.bytecode.emitOp(Opcode.OP_inc)
      }

      if (trailingHole) {
        const lengthAtom = context.getAtom('length')
        context.bytecode.emitOp(Opcode.OP_dup1)
        context.bytecode.emitOp(Opcode.OP_put_field)
        context.bytecode.emitAtom(lengthAtom)
        context.bytecode.emitIC(lengthAtom)
      } else {
        context.bytecode.emitOp(Opcode.OP_drop)
      }
      return
    }

    context.bytecode.emitOp(Opcode.OP_array_from)
    context.bytecode.emitU16(0)
    context.bytecode.emitOp(Opcode.OP_push_i32)
    context.bytecode.emitU32(0)

    let trailingHole = false
    for (const element of elements) {
      if (element.kind === ts.SyntaxKind.OmittedExpression) {
        trailingHole = true
        context.bytecode.emitOp(Opcode.OP_inc)
        continue
      }

      trailingHole = false
      emitExpression(element as ts.Expression, context)
      context.bytecode.emitOp(Opcode.OP_define_array_el)
      context.bytecode.emitOp(Opcode.OP_inc)
    }

    if (trailingHole) {
      const lengthAtom = context.getAtom('length')
      context.bytecode.emitOp(Opcode.OP_dup1)
      context.bytecode.emitOp(Opcode.OP_put_field)
      context.bytecode.emitAtom(lengthAtom)
      context.bytecode.emitIC(lengthAtom)
    } else {
      context.bytecode.emitOp(Opcode.OP_drop)
    }
  }

  /**
   * @source QuickJS/src/core/parser.c:3760-3885
   * @see js_parse_object_literal
   */
  emitObjectLiteral(node: ts.ObjectLiteralExpression, context: EmitterContext, emitExpression: ExpressionEmitterFn) {
    context.bytecode.emitOp(Opcode.OP_object)

    for (const prop of node.properties) {
      if (ts.isMethodDeclaration(prop) || ts.isGetAccessorDeclaration(prop) || ts.isSetAccessorDeclaration(prop)) {
        const isComputed = ts.isComputedPropertyName(prop.name)
        const opFlags = ts.isGetAccessorDeclaration(prop)
          ? OP_DEFINE_METHOD_GETTER
          : ts.isSetAccessorDeclaration(prop)
              ? OP_DEFINE_METHOD_SETTER
              : OP_DEFINE_METHOD_METHOD

        if (isComputed) {
          emitExpression((prop.name as ts.ComputedPropertyName).expression, context)
          context.bytecode.emitOp(Opcode.OP_to_propkey)
        }

        this.functionEmitter.emitFunctionClosure(prop, context)

        if (isComputed) {
          context.bytecode.emitOp(Opcode.OP_define_method_computed)
        } else {
          context.bytecode.emitOp(Opcode.OP_define_method)
          context.bytecode.emitAtom(context.getAtom(this.getPropertyNameText(prop.name)))
        }
        context.bytecode.emitU8(opFlags | OP_DEFINE_METHOD_ENUMERABLE)
        continue
      }

      if (ts.isPropertyAssignment(prop)) {
        if (ts.isComputedPropertyName(prop.name)) {
          emitExpression(prop.name.expression, context)
          context.bytecode.emitOp(Opcode.OP_to_propkey)
          emitExpression(prop.initializer, context)
          context.bytecode.emitOp(Opcode.OP_define_array_el)
          context.bytecode.emitOp(Opcode.OP_drop)
          continue
        }

        const nameText = this.getPropertyNameText(prop.name)
        if (nameText === '__proto__') {
          emitExpression(prop.initializer, context)
          context.bytecode.emitOp(Opcode.OP_set_proto)
          continue
        }

        emitExpression(prop.initializer, context)
        if (
          (ts.isFunctionExpression(prop.initializer) && !prop.initializer.name) ||
          ts.isArrowFunction(prop.initializer)
        ) {
          context.bytecode.emitOp(Opcode.OP_set_name)
          context.bytecode.emitAtom(context.getAtom(nameText))
        }
        context.bytecode.emitOp(Opcode.OP_define_field)
        context.bytecode.emitAtom(context.getAtom(nameText))
        continue
      }

      if (ts.isShorthandPropertyAssignment(prop)) {
        const atom = context.getAtom(prop.name.text)
        context.bytecode.emitOp(Opcode.OP_get_var)
        context.bytecode.emitAtom(atom)
        context.bytecode.emitOp(Opcode.OP_define_field)
        context.bytecode.emitAtom(atom)
        continue
      }

      if (ts.isSpreadAssignment(prop)) {
        emitExpression(prop.expression, context)
        context.bytecode.emitOp(Opcode.OP_null)
        context.bytecode.emitOp(Opcode.OP_copy_data_properties)
        context.bytecode.emitU8(COPY_DATA_PROPERTIES_OPERAND_SPREAD)
        context.bytecode.emitOp(Opcode.OP_drop)
        context.bytecode.emitOp(Opcode.OP_drop)
        continue
      }

      const propKind = (prop as ts.Node).kind
      throw new Error(`: ${ts.SyntaxKind[propKind]}`)
    }
  }

  private getPropertyNameText(name: ts.PropertyName): string {
    if (ts.isIdentifier(name) || ts.isStringLiteral(name) || ts.isNumericLiteral(name)) {
      return name.text
    }
    if (ts.isPrivateIdentifier(name)) {
      return name.text
    }
    throw new Error(`: ${ts.SyntaxKind[name.kind]}`)
  }
}

import ts from 'typescript'

import { DEFINE_GLOBAL_FUNC_VAR, JSVarKindEnum, Opcode, OPSpecialObjectEnum } from '../env'
import { BytecodeCompiler, EmitterContext } from './emitter'
import { BytecodeBuffer } from './bytecode-buffer'
import { ConstantPoolManager } from './constant-pool'
import { InlineCacheManager } from './inline-cache'
import { DestructuringEmitter } from './destructuring'

export interface FunctionTemplate {
  kind: 'function'
  name?: string
  params: string[]
  isArrow: boolean
  isAsync: boolean
  isGenerator: boolean
  bodyText: string
  bytecode?: Uint8Array
}

interface SpecialVarUsage {
  usesArguments: boolean
  usesThis: boolean
  usesNewTarget: boolean
}

interface SpecialVarIndices {
  argumentsVar?: number
  thisVar?: number
  newTargetVar?: number
  argumentsMapped?: boolean
}

const createTemplate = (node: ts.FunctionLikeDeclarationBase, sourceFile: ts.SourceFile): FunctionTemplate => {
  const params: string[] = []
  for (const param of node.parameters) {
    if (ts.isIdentifier(param.name)) {
      params.push(param.name.text)
    } else {
      params.push(param.name.getText(sourceFile))
    }
  }

  return {
    kind: 'function',
    name: node.name && ts.isIdentifier(node.name) ? node.name.text : undefined,
    params,
    isArrow: ts.isArrowFunction(node),
    isAsync: Boolean(node.modifiers?.some(mod => mod.kind === ts.SyntaxKind.AsyncKeyword)),
    isGenerator: Boolean((node as ts.FunctionDeclaration | ts.FunctionExpression).asteriskToken),
    bodyText: node.body ? node.body.getText(sourceFile) : '',
  }
}

/**
 *  Pass 
 *
 * @source QuickJS/src/core/parser.c:12979-13618
 * @see js_parse_function_decl2
 */
export class FunctionEmitter {
  private destructuringEmitter = new DestructuringEmitter()

  emitFunctionExpression(node: ts.FunctionExpression | ts.ArrowFunction, context: EmitterContext) {
    this.emitFunctionClosure(node, context, { setName: true })
  }

  emitFunctionDeclaration(node: ts.FunctionDeclaration, context: EmitterContext) {
    if (!node.name || !ts.isIdentifier(node.name)) {
      throw new Error('')
    }
    const name = node.name.text
    const atom = context.getAtom(name)

    context.bytecode.emitOp(Opcode.OP_check_define_var)
    context.bytecode.emitAtom(atom)
    context.bytecode.emitU8(DEFINE_GLOBAL_FUNC_VAR)

    this.emitFunctionClosure(node, context)

    context.bytecode.emitOp(Opcode.OP_define_func)
    context.bytecode.emitAtom(atom)
    context.bytecode.emitU8(0)
  }

  private createFunctionTemplate(
    node: ts.FunctionLikeDeclarationBase,
    context: EmitterContext,
    options: { privateBindings?: Map<string, { index: number; kind: 'field' | 'method' | 'accessor' }> } = {},
  ): FunctionTemplate {
    const template = createTemplate(node, context.sourceFile)
    template.bytecode = this.compileFunctionBody(node, context, options)
    return template
  }

  buildFunctionTemplate(node: ts.FunctionLikeDeclarationBase, context: EmitterContext): FunctionTemplate {
    return this.createFunctionTemplate(node, context)
  }

  emitFunctionClosure(
    node: ts.FunctionLikeDeclarationBase,
    context: EmitterContext,
    options: {
      setName?: boolean
      privateBindings?: Map<string, { index: number; kind: 'field' | 'method' | 'accessor' }>
    } = {},
  ) {
    const template = this.createFunctionTemplate(node, context, {
      privateBindings: options.privateBindings,
    })
    const idx = context.constantPool.add(template)
    context.bytecode.emitOp(Opcode.OP_fclosure)
    context.bytecode.emitU32(idx)

    if (options.setName && template.name) {
      const atom = context.getAtom(template.name)
      context.bytecode.emitOp(Opcode.OP_set_name)
      context.bytecode.emitAtom(atom)
    }
  }

  private compileFunctionBody(
    node: ts.FunctionLikeDeclarationBase,
    parentContext: EmitterContext,
    options: { privateBindings?: Map<string, { index: number; kind: 'field' | 'method' | 'accessor' }> } = {},
  ): Uint8Array {
    const bytecode = new BytecodeBuffer()
    const inlineCache = new InlineCacheManager()
    const constantPool = new ConstantPoolManager()
    const compiler = new BytecodeCompiler({
      atomTable: parentContext.atomTable,
      inlineCache,
      constantPool,
      bytecode,
      expressionStatementDrop: true,
    })
    const argMap = new Map<string, number>()
    node.parameters.forEach((param, index) => {
      if (ts.isIdentifier(param.name)) {
        argMap.set(param.name.text, index)
      }
    })

    const context = new EmitterContext({
      sourceFile: parentContext.sourceFile,
      atomTable: parentContext.atomTable,
      bytecode,
      inlineCache,
      constantPool,
      argMap,
      inFunction: true,
      inArrow: ts.isArrowFunction(node),
      inAsync: Boolean(node.modifiers?.some(mod => mod.kind === ts.SyntaxKind.AsyncKeyword)),
      inGenerator: Boolean((node as ts.FunctionDeclaration | ts.FunctionExpression).asteriskToken),
      privateBindings: options.privateBindings,
    })

    context.scopes.pushScope()
    const specialUsage = this.collectSpecialVarUsage(node)
    const hasUseStrict = this.hasUseStrictDirective(node)
    const hasSimpleParameterList = this.hasSimpleParameterList(node)
    const specialVars = this.registerSpecialVariables(node, context, argMap, specialUsage, {
      hasUseStrict,
      hasSimpleParameterList,
    })
    this.registerParameterLocals(node, context)

    if (!node.body) {
      if (context.inAsync) {
        context.bytecode.emitOp(Opcode.OP_undefined)
        context.bytecode.emitOp(Opcode.OP_return_async)
      } else {
        context.bytecode.emitOp(Opcode.OP_return_undef)
      }
      context.scopes.popScope()
      return bytecode.toUint8Array()
    }

    if (ts.isBlock(node.body)) {
      this.emitSpecialVarPrologue(specialVars, context)
      if (context.inGenerator) {
        context.bytecode.emitOp(Opcode.OP_initial_yield)
      }
      this.emitParameterInitializers(node, context, compiler)
      const restArgName = this.getRestIdentifierName(node)
      if (this.tryEmitRestReturn(node.body.statements, context, restArgName)) {
        context.scopes.popScope()
        return bytecode.toUint8Array()
      }
      compiler.compileStatements(node.body.statements, context)
      this.ensureReturn(bytecode, context)
      context.scopes.popScope()
      return bytecode.toUint8Array()
    }

    // Arrow function expression body
    this.emitSpecialVarPrologue(specialVars, context)
    if (context.inGenerator) {
      context.bytecode.emitOp(Opcode.OP_initial_yield)
    }
    this.emitParameterInitializers(node, context, compiler)
    compiler.emitExpression(node.body, context)
    if (context.inAsync) {
      context.bytecode.emitOp(Opcode.OP_return_async)
    } else {
      context.bytecode.emitOp(Opcode.OP_return)
    }
    context.scopes.popScope()
    return bytecode.toUint8Array()
  }

  private registerParameterLocals(node: ts.FunctionLikeDeclarationBase, context: EmitterContext) {
    const seen = new Set<string>()

    for (const param of node.parameters) {
      if (ts.isIdentifier(param.name)) {
        continue
      }
      this.collectBindingIdentifiers(param.name, context, seen)
    }
  }

  private collectSpecialVarUsage(node: ts.FunctionLikeDeclarationBase): SpecialVarUsage {
    const usage: SpecialVarUsage = { usesArguments: false, usesThis: false, usesNewTarget: false }
    if (!node.body) return usage

    const isIdentifierReference = (id: ts.Identifier): boolean => {
      const parent = id.parent
      if (!parent) return true
      if (ts.isPropertyAccessExpression(parent) && parent.name === id) return false
      if (ts.isPropertyAccessChain(parent) && parent.name === id) return false
      if (ts.isBindingElement(parent) && parent.name === id) return false
      if (ts.isParameter(parent) && parent.name === id) return false
      if (ts.isVariableDeclaration(parent) && parent.name === id) return false
      if (ts.isFunctionDeclaration(parent) && parent.name === id) return false
      if (ts.isFunctionExpression(parent) && parent.name === id) return false
      if (ts.isClassDeclaration(parent) && parent.name === id) return false
      if (ts.isClassExpression(parent) && parent.name === id) return false
      if (ts.isImportClause(parent)) return false
      if (ts.isImportSpecifier(parent)) return false
      if (ts.isNamespaceImport(parent)) return false
      if (ts.isImportEqualsDeclaration(parent)) return false
      if (ts.isExportSpecifier(parent)) return false
      return true
    }

    const visit = (current: ts.Node, root: ts.Node) => {
      if (current !== root && (ts.isFunctionLike(current) || ts.isClassLike(current))) return
      if (current.kind === ts.SyntaxKind.ThisKeyword) {
        usage.usesThis = true
      }
      if (ts.isMetaProperty(current)) {
        if (current.keywordToken === ts.SyntaxKind.NewKeyword && current.name.text === 'target') {
          usage.usesNewTarget = true
        }
      }
      if (ts.isIdentifier(current) && current.text === 'arguments' && isIdentifierReference(current)) {
        usage.usesArguments = true
      }
      ts.forEachChild(current, child => visit(child, root))
    }

    visit(node.body, node.body)
    return usage
  }

  private registerSpecialVariables(
    node: ts.FunctionLikeDeclarationBase,
    context: EmitterContext,
    argMap: Map<string, number>,
    usage: SpecialVarUsage,
    options: { hasUseStrict: boolean; hasSimpleParameterList: boolean },
  ): SpecialVarIndices {
    const indices: SpecialVarIndices = {}
    if (context.inArrow) return indices

    if (usage.usesNewTarget) {
      const atom = context.getAtom('new.target')
      const index = context.scopes.addScopeVar(atom, JSVarKindEnum.JS_VAR_NORMAL)
      context.setSpecialVar('new.target', index)
      indices.newTargetVar = index
    }

    if (usage.usesThis) {
      const atom = context.getAtom('this')
      const index = context.scopes.addScopeVar(atom, JSVarKindEnum.JS_VAR_NORMAL)
      context.setSpecialVar('this', index)
      indices.thisVar = index
    }

    if (usage.usesArguments && !argMap.has('arguments')) {
      const atom = context.getAtom('arguments')
      const index = context.scopes.addScopeVar(atom, JSVarKindEnum.JS_VAR_NORMAL)
      context.setSpecialVar('arguments', index)
      indices.argumentsVar = index
      indices.argumentsMapped = !options.hasUseStrict && options.hasSimpleParameterList
    }

    return indices
  }

  private emitSpecialVarPrologue(indices: SpecialVarIndices, context: EmitterContext) {
    if (indices.newTargetVar !== undefined) {
      context.bytecode.emitOp(Opcode.OP_special_object)
      context.bytecode.emitU8(OPSpecialObjectEnum.OP_SPECIAL_OBJECT_NEW_TARGET)
      context.bytecode.emitOp(Opcode.OP_put_loc)
      context.bytecode.emitU16(indices.newTargetVar)
    }

    if (indices.thisVar !== undefined) {
      context.bytecode.emitOp(Opcode.OP_push_this)
      context.bytecode.emitOp(Opcode.OP_put_loc)
      context.bytecode.emitU16(indices.thisVar)
    }

    if (indices.argumentsVar !== undefined) {
      context.bytecode.emitOp(Opcode.OP_special_object)
      context.bytecode.emitU8(
        indices.argumentsMapped
          ? OPSpecialObjectEnum.OP_SPECIAL_OBJECT_MAPPED_ARGUMENTS
          : OPSpecialObjectEnum.OP_SPECIAL_OBJECT_ARGUMENTS,
      )
      context.bytecode.emitOp(Opcode.OP_put_loc)
      context.bytecode.emitU16(indices.argumentsVar)
    }
  }

  private hasUseStrictDirective(node: ts.FunctionLikeDeclarationBase): boolean {
    if (!node.body || !ts.isBlock(node.body)) return false
    for (const stmt of node.body.statements) {
      if (!ts.isExpressionStatement(stmt)) return false
      const expr = stmt.expression
      if (!ts.isStringLiteral(expr)) return false
      if (expr.text === 'use strict') return true
    }
    return false
  }

  private hasSimpleParameterList(node: ts.FunctionLikeDeclarationBase): boolean {
    for (const param of node.parameters) {
      if (param.dotDotDotToken) return false
      if (param.initializer) return false
      if (!ts.isIdentifier(param.name)) return false
    }
    return true
  }

  private collectBindingIdentifiers(
    name: ts.BindingName,
    context: EmitterContext,
    seen: Set<string>,
  ) {
    if (ts.isIdentifier(name)) {
      this.registerLocalIdentifier(name, context, seen)
      return
    }

    if (ts.isObjectBindingPattern(name)) {
      for (const element of name.elements) {
        if (!element) continue
        this.collectBindingIdentifiers(element.name, context, seen)
      }
      return
    }

    if (ts.isArrayBindingPattern(name)) {
      for (const element of name.elements) {
        if (!element) continue
        if (ts.isOmittedExpression(element)) continue
        this.collectBindingIdentifiers(element.name, context, seen)
      }
    }
  }

  private registerLocalIdentifier(name: ts.Identifier, context: EmitterContext, seen: Set<string>) {
    if (seen.has(name.text)) return
    const atom = context.getAtom(name.text)
    const scopeLevel = context.scopes.scopeLevel
    if (scopeLevel >= 0 && context.scopes.findVarInScope(atom, scopeLevel) < 0) {
      context.scopes.addScopeVar(atom, JSVarKindEnum.JS_VAR_NORMAL)
    }
    seen.add(name.text)
  }

  /**
   * /
   *
   * @source QuickJS/src/core/parser.c:13193-13318
   * @see js_parse_function_decl2
   */
  private emitParameterInitializers(
    node: ts.FunctionLikeDeclarationBase,
    context: EmitterContext,
    compiler: BytecodeCompiler,
  ) {
    node.parameters.forEach((param, index) => {
      const isBindingPattern = ts.isObjectBindingPattern(param.name) || ts.isArrayBindingPattern(param.name)

      if (isBindingPattern) {
        if (param.dotDotDotToken) {
          context.bytecode.emitOp(Opcode.OP_rest)
          context.bytecode.emitU16(index)
        } else {
          context.bytecode.emitOp(Opcode.OP_get_arg)
          context.bytecode.emitU16(index)
        }

        if (param.initializer) {
          const label = context.labels.newLabel()
          context.bytecode.emitOp(Opcode.OP_dup)
          context.bytecode.emitOp(Opcode.OP_undefined)
          context.bytecode.emitOp(Opcode.OP_strict_eq)
          context.labels.emitGoto(Opcode.OP_if_false, label)
          context.bytecode.emitOp(Opcode.OP_drop)
          compiler.emitExpression(param.initializer, context)
          context.labels.emitLabel(label)
        }

        this.destructuringEmitter.emitBindingPatternFromValue(param.name, context, compiler.emitExpression.bind(compiler))
        return
      }

      if (!ts.isIdentifier(param.name)) return

      if (param.dotDotDotToken) {
        context.bytecode.emitOp(Opcode.OP_rest)
        context.bytecode.emitU16(index)
        this.emitSetArg(index, context)
        return
      }

      if (!param.initializer) return

      const label = context.labels.newLabel()
      context.bytecode.emitOp(Opcode.OP_get_arg)
      context.bytecode.emitU16(index)
      context.bytecode.emitOp(Opcode.OP_undefined)
      context.bytecode.emitOp(Opcode.OP_strict_eq)
      context.labels.emitGoto(Opcode.OP_if_false, label)
      compiler.emitExpression(param.initializer, context)
      context.bytecode.emitOp(Opcode.OP_put_arg)
      context.bytecode.emitU16(index)
      context.labels.emitLabel(label)
    })
  }

  private emitSetArg(index: number, context: EmitterContext) {
    switch (index) {
      case 0:
        context.bytecode.emitOp(Opcode.OP_set_arg0)
        break
      case 1:
        context.bytecode.emitOp(Opcode.OP_set_arg1)
        break
      case 2:
        context.bytecode.emitOp(Opcode.OP_set_arg2)
        break
      case 3:
        context.bytecode.emitOp(Opcode.OP_set_arg3)
        break
      default:
        context.bytecode.emitOp(Opcode.OP_set_arg)
        context.bytecode.emitU16(index)
        break
    }
  }

  private getRestIdentifierName(node: ts.FunctionLikeDeclarationBase): string | undefined {
    for (const param of node.parameters) {
      if (param.dotDotDotToken && ts.isIdentifier(param.name)) {
        return param.name.text
      }
    }
    return undefined
  }

  private tryEmitRestReturn(
    statements: ts.NodeArray<ts.Statement>,
    context: EmitterContext,
    restArgName?: string,
  ): boolean {
    if (!restArgName || statements.length !== 1) return false
    const stmt = statements[0]
    if (!ts.isReturnStatement(stmt) || !stmt.expression) return false
    if (!ts.isIdentifier(stmt.expression)) return false
    if (stmt.expression.text !== restArgName) return false

    context.emitSourcePos(stmt)
    context.bytecode.emitOp(context.inAsync ? Opcode.OP_return_async : Opcode.OP_return)
    return true
  }

  private ensureReturn(bytecode: BytecodeBuffer, context: EmitterContext) {
    if (bytecode.length === 0) {
      if (context.inAsync && context.inGenerator) {
        context.bytecode.emitOp(Opcode.OP_undefined)
        context.bytecode.emitOp(Opcode.OP_await)
        context.bytecode.emitOp(Opcode.OP_return_async)
      } else if (context.inAsync || context.inGenerator) {
        context.bytecode.emitOp(Opcode.OP_undefined)
        context.bytecode.emitOp(Opcode.OP_return_async)
      } else {
        context.bytecode.emitOp(Opcode.OP_return_undef)
      }
      return
    }
    const snapshot = bytecode.snapshot()
    const lastOpcode = snapshot.buffer[context.bytecode.lastOpcodePos]
    if (
      lastOpcode !== Opcode.OP_return &&
      lastOpcode !== Opcode.OP_return_undef &&
      lastOpcode !== Opcode.OP_return_async
    ) {
      if (context.inAsync && context.inGenerator) {
        context.bytecode.emitOp(Opcode.OP_undefined)
        context.bytecode.emitOp(Opcode.OP_await)
        context.bytecode.emitOp(Opcode.OP_return_async)
      } else if (context.inAsync || context.inGenerator) {
        context.bytecode.emitOp(Opcode.OP_undefined)
        context.bytecode.emitOp(Opcode.OP_return_async)
      } else {
        context.bytecode.emitOp(Opcode.OP_return_undef)
      }
    }
  }
}

import { Opcode } from '../env'
import type { EmitterContext } from './emitter'

export interface ParsedRegexp {
  body: string
  flags: string
}

const parseRegexLiteral = (text: string): ParsedRegexp => {
  if (!text.startsWith('/')) {
    throw new Error('')
  }

  let inClass = false
  let escaped = false
  let end = -1

  for (let i = 1; i < text.length; i += 1) {
    const ch = text[i]
    if (escaped) {
      escaped = false
      continue
    }
    if (ch === '\\') {
      escaped = true
      continue
    }
    if (ch === '[') {
      inClass = true
      continue
    }
    if (ch === ']' && inClass) {
      inClass = false
      continue
    }
    if (ch === '/' && !inClass) {
      end = i
      break
    }
  }

  if (end < 0) {
    throw new Error('')
  }

  return {
    body: text.slice(1, end),
    flags: text.slice(end + 1),
  }
}

const emitPushConst = (context: EmitterContext, value: unknown) => {
  const index = context.constantPool.add(value)
  context.bytecode.emitOp(Opcode.OP_push_const)
  context.bytecode.emitU32(index)
}

/**
 * 
 *
 * @source QuickJS/src/core/parser.c:467-571
 * @see js_parse_regexp
 */
export const emitRegexpLiteral = (text: string, context: EmitterContext) => {
  const { body, flags } = parseRegexLiteral(text)
  emitPushConst(context, body)
  emitPushConst(context, flags)
  context.bytecode.emitOp(Opcode.OP_regexp)
}

import ts from 'typescript'

import {
  JS_DEFINE_CLASS_HAS_HERITAGE,
  OP_DEFINE_METHOD_GETTER,
  OP_DEFINE_METHOD_METHOD,
  OP_DEFINE_METHOD_SETTER,
  OPSpecialObjectEnum,
  Opcode,
} from '../env'
import type { EmitterContext } from './emitter'
import { BytecodeBuffer } from './bytecode-buffer'
import { ConstantPoolManager } from './constant-pool'
import { InlineCacheManager } from './inline-cache'
import { BytecodeCompiler, EmitterContext as FunctionContext } from './emitter'
import { FunctionEmitter, type FunctionTemplate } from './functions'

export type ClassExpressionEmitterFn = (node: ts.Expression, context: EmitterContext) => void

interface ClassMethodDef {
  node: ts.MethodDeclaration
  name: ts.PropertyName | ts.PrivateIdentifier
  isStatic: boolean
  isComputed: boolean
}

interface ClassAccessorDef {
  node: ts.GetAccessorDeclaration | ts.SetAccessorDeclaration
  name: ts.PropertyName | ts.PrivateIdentifier
  isStatic: boolean
  isComputed: boolean
  isSetter: boolean
}

interface ClassFieldDef {
  node: ts.PropertyDeclaration
  name: ts.PropertyName | ts.PrivateIdentifier
  isStatic: boolean
  isComputed: boolean
}

interface ClassStaticBlockDef {
  node: ts.ClassStaticBlockDeclaration
}

interface PrivateBinding {
  name: string
  local: number
  isStatic: boolean
  kind: 'field' | 'method' | 'accessor'
  node?: ts.FunctionLikeDeclarationBase
}

/**
 *  + 
 *
 * @source QuickJS/src/core/parser.c:3230-3740
 * @see js_parse_class
 */
export class ClassEmitter {
  private functionEmitter = new FunctionEmitter()

  emitClassDeclaration(
    node: ts.ClassDeclaration,
    context: EmitterContext,
    emitExpression: ClassExpressionEmitterFn,
  ) {
    if (!node.name || !ts.isIdentifier(node.name)) {
      throw new Error('')
    }
    this.emitClass(node, context, emitExpression, { declarationName: node.name.text })
  }

  emitClassExpression(
    node: ts.ClassExpression,
    context: EmitterContext,
    emitExpression: ClassExpressionEmitterFn,
  ) {
    this.emitClass(node, context, emitExpression, { declarationName: undefined })
  }

  private emitClass(
    node: ts.ClassLikeDeclaration,
    context: EmitterContext,
    emitExpression: ClassExpressionEmitterFn,
    options: { declarationName?: string },
  ) {
    context.emitSourcePos(node)

    const heritage = node.heritageClauses?.find(clause => clause.token === ts.SyntaxKind.ExtendsKeyword)
    const isDerived = Boolean(heritage && heritage.types.length > 0)
    const className = node.name && ts.isIdentifier(node.name) ? node.name.text : options.declarationName
    const classAtom = className ? context.getAtom(className) : context.getAtom('')
    const classFlags = isDerived ? JS_DEFINE_CLASS_HAS_HERITAGE : 0

    const classNameLoc = className ? context.allocateTempLocal() : -1
    const classFieldsLoc = context.allocateTempLocal()
    const shouldCloseClassName = Boolean(className && this.classNameIsReferenced(node, className))

    const { methods, accessors, fields, staticBlocks, privateBindings } = this.collectMembers(node)
    const computedInstanceFields = fields.filter(field => !field.isStatic && field.isComputed)
    const computedStaticFields = fields.filter(field => field.isStatic && field.isComputed)

    const computedInstanceLocals = new Map<ClassFieldDef, number>()
    const computedStaticLocals = new Map<ClassFieldDef, number>()
    const privateBindingInfo = new Map<string, { index: number; kind: 'field' | 'method' | 'accessor' }>()
    const privateFieldLocals = new Map<string, number>()

    for (const field of computedStaticFields) {
      computedStaticLocals.set(field, context.allocateTempLocal())
    }
    for (const field of computedInstanceFields) {
      computedInstanceLocals.set(field, context.allocateTempLocal())
    }

    let privateIndex = 0
    for (const binding of privateBindings) {
      binding.local = context.allocateTempLocal()
      if (!privateBindingInfo.has(binding.name)) {
        privateBindingInfo.set(binding.name, { index: privateIndex, kind: binding.kind })
        privateIndex += 1
      }
      if (binding.kind === 'field') {
        privateFieldLocals.set(`${binding.name}:${binding.isStatic ? 'static' : 'instance'}`, binding.local)
      }
    }

    if (classNameLoc >= 0) {
      context.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
      context.bytecode.emitU16(classNameLoc)
    }

    if (isDerived && heritage?.types[0]) {
      emitExpression(heritage.types[0].expression, context)
    } else {
      context.bytecode.emitOp(Opcode.OP_undefined)
    }

    context.bytecode.emitOp(Opcode.OP_undefined)
    context.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
    context.bytecode.emitU16(classFieldsLoc)

    for (const binding of privateBindings) {
      context.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
      context.bytecode.emitU16(binding.local)
    }

    for (const field of computedStaticFields) {
      const local = computedStaticLocals.get(field) ?? -1
      context.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
      context.bytecode.emitU16(local)
    }

    for (const field of computedInstanceFields) {
      const local = computedInstanceLocals.get(field) ?? -1
      context.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
      context.bytecode.emitU16(local)
    }

    const ctorTemplate = this.getConstructorTemplate(node, context, isDerived, privateBindingInfo)
    const ctorIndex = context.constantPool.add(ctorTemplate)
    context.bytecode.emitOp(Opcode.OP_push_const)
    context.bytecode.emitU32(ctorIndex)

    context.bytecode.emitOp(Opcode.OP_define_class)
    context.bytecode.emitAtom(classAtom)
    context.bytecode.emitU8(classFlags)

    for (const field of fields) {
      if (ts.isPrivateIdentifier(field.name)) {
        const local = privateFieldLocals.get(`${field.name.text}:${field.isStatic ? 'static' : 'instance'}`)
        if (local === undefined) continue
        if (field.isStatic) {
          context.bytecode.emitOp(Opcode.OP_swap)
        }
        context.bytecode.emitOp(Opcode.OP_private_symbol)
        context.bytecode.emitAtom(context.getAtom(field.name.text))
        context.bytecode.emitOp(Opcode.OP_put_loc)
        context.bytecode.emitU16(local)
        if (field.isStatic) {
          context.bytecode.emitOp(Opcode.OP_swap)
        }
        continue
      }

      if (field.isStatic && !field.isComputed) {
        context.bytecode.emitOp(Opcode.OP_swap)
        context.bytecode.emitOp(Opcode.OP_swap)
      }
    }

    for (const field of computedInstanceFields) {
      const local = computedInstanceLocals.get(field) ?? -1
      emitExpression(this.getComputedNameExpression(field.name), context)
      context.bytecode.emitOp(Opcode.OP_to_propkey)
      context.bytecode.emitOp(Opcode.OP_put_loc)
      context.bytecode.emitU16(local)
      context.bytecode.emitOp(Opcode.OP_swap)
    }

    for (const field of computedStaticFields) {
      const local = computedStaticLocals.get(field) ?? -1
      context.bytecode.emitOp(Opcode.OP_swap)
      emitExpression(this.getComputedNameExpression(field.name), context)
      context.bytecode.emitOp(Opcode.OP_to_propkey)
      context.bytecode.emitOp(Opcode.OP_put_loc)
      context.bytecode.emitU16(local)
      context.bytecode.emitOp(Opcode.OP_swap)
    }

    for (const binding of privateBindings) {
      if (binding.kind !== 'method' && binding.kind !== 'accessor') continue
      if (!binding.node) continue
      if (binding.isStatic) {
        context.bytecode.emitOp(Opcode.OP_swap)
      }
      this.functionEmitter.emitFunctionClosure(binding.node, context, { privateBindings: privateBindingInfo })
      context.bytecode.emitOp(Opcode.OP_set_home_object)
      if (binding.kind === 'method') {
        context.bytecode.emitOp(Opcode.OP_set_name)
        context.bytecode.emitAtom(context.getAtom(binding.name))
        context.bytecode.emitOp(Opcode.OP_put_loc)
        context.bytecode.emitU16(binding.local)
      } else {
        context.bytecode.emitOp(Opcode.OP_put_loc)
        context.bytecode.emitU16(binding.local)
      }
      if (binding.isStatic) {
        context.bytecode.emitOp(Opcode.OP_swap)
      }
    }

    for (const method of methods) {
      if (method.isStatic) {
        context.bytecode.emitOp(Opcode.OP_swap)
      }
      this.functionEmitter.emitFunctionClosure(method.node, context, { privateBindings: privateBindingInfo })
      if (method.isComputed) {
        context.bytecode.emitOp(Opcode.OP_define_method_computed)
      } else {
        context.bytecode.emitOp(Opcode.OP_define_method)
        context.bytecode.emitAtom(context.getAtom(this.getPropertyName(method.name)))
      }
      context.bytecode.emitU8(OP_DEFINE_METHOD_METHOD)
      if (method.isStatic) {
        context.bytecode.emitOp(Opcode.OP_swap)
      }
    }

    for (const accessor of accessors) {
      if (accessor.isStatic) {
        context.bytecode.emitOp(Opcode.OP_swap)
      }
      this.functionEmitter.emitFunctionClosure(accessor.node, context, { privateBindings: privateBindingInfo })
      if (accessor.isComputed) {
        context.bytecode.emitOp(Opcode.OP_define_method_computed)
      } else {
        context.bytecode.emitOp(Opcode.OP_define_method)
        context.bytecode.emitAtom(context.getAtom(this.getPropertyName(accessor.name)))
      }
      context.bytecode.emitU8(accessor.isSetter ? OP_DEFINE_METHOD_SETTER : OP_DEFINE_METHOD_GETTER)
      if (accessor.isStatic) {
        context.bytecode.emitOp(Opcode.OP_swap)
      }
    }

    const needsBrand = privateBindings.some(binding => !binding.isStatic && binding.kind !== 'field')
    if (needsBrand) {
      context.bytecode.emitOp(Opcode.OP_dup)
      context.bytecode.emitOp(Opcode.OP_null)
      context.bytecode.emitOp(Opcode.OP_swap)
      context.bytecode.emitOp(Opcode.OP_add_brand)
    }

    const instanceFields = fields.filter(field => !field.isStatic)
    if (instanceFields.length > 0 || needsBrand) {
      const template = this.buildFieldsInitTemplate(instanceFields, context, emitExpression, {
        isStatic: false,
        privateBindings: privateBindingInfo,
      })
      const idx = context.constantPool.add(template)
      context.bytecode.emitOp(Opcode.OP_fclosure)
      context.bytecode.emitU32(idx)
      context.bytecode.emitOp(Opcode.OP_set_home_object)
      context.bytecode.emitOp(Opcode.OP_put_loc)
      context.bytecode.emitU16(classFieldsLoc)
    } else {
      context.bytecode.emitOp(Opcode.OP_undefined)
      context.bytecode.emitOp(Opcode.OP_put_loc)
      context.bytecode.emitU16(classFieldsLoc)
    }
    context.bytecode.emitOp(Opcode.OP_drop)

    const staticNeedsBrand = privateBindings.some(binding => binding.isStatic && binding.kind !== 'field')
    if (staticNeedsBrand) {
      context.bytecode.emitOp(Opcode.OP_dup)
      context.bytecode.emitOp(Opcode.OP_dup)
      context.bytecode.emitOp(Opcode.OP_add_brand)
    }

    if (classNameLoc >= 0) {
      context.bytecode.emitOp(Opcode.OP_set_loc)
      context.bytecode.emitU16(classNameLoc)
    }

    const staticFields = fields.filter(field => field.isStatic)
    if (staticFields.length > 0 || staticBlocks.length > 0) {
      const staticTemplate = this.buildFieldsInitTemplate(staticFields, context, emitExpression, {
        isStatic: true,
        privateBindings: privateBindingInfo,
        staticBlocks,
      })
      const idx = context.constantPool.add(staticTemplate)
      context.bytecode.emitOp(Opcode.OP_dup)
      context.bytecode.emitOp(Opcode.OP_fclosure)
      context.bytecode.emitU32(idx)
      context.bytecode.emitOp(Opcode.OP_set_home_object)
      context.bytecode.emitOp(Opcode.OP_call_method)
      context.bytecode.emitU16(0)
      context.bytecode.emitOp(Opcode.OP_drop)
    }

    context.bytecode.emitOp(Opcode.OP_close_loc)
    context.bytecode.emitU16(classFieldsLoc)

    if (classNameLoc >= 0 && shouldCloseClassName) {
      context.bytecode.emitOp(Opcode.OP_close_loc)
      context.bytecode.emitU16(classNameLoc)
    }

    for (const field of computedStaticFields) {
      const local = computedStaticLocals.get(field) ?? -1
      context.bytecode.emitOp(Opcode.OP_close_loc)
      context.bytecode.emitU16(local)
    }

    for (const field of computedInstanceFields) {
      const local = computedInstanceLocals.get(field) ?? -1
      context.bytecode.emitOp(Opcode.OP_close_loc)
      context.bytecode.emitU16(local)
    }

    for (const binding of privateBindings) {
      if (binding.kind !== 'field') continue
      context.bytecode.emitOp(Opcode.OP_close_loc)
      context.bytecode.emitU16(binding.local)
    }

    if (options.declarationName) {
      context.bytecode.emitOp(Opcode.OP_put_var_init)
      context.bytecode.emitAtom(context.getAtom(options.declarationName))
    } else {
      context.bytecode.emitOp(Opcode.OP_drop)
    }
  }

  private classNameIsReferenced(node: ts.ClassLikeDeclaration, className: string): boolean {
    const isIdentifierReference = (id: ts.Identifier): boolean => {
      const parent = id.parent
      if (!parent) return false
      if (ts.isPropertyAccessExpression(parent) && parent.name === id) return false
      if (ts.isPropertyAccessChain(parent) && parent.name === id) return false
      if (ts.isPropertyAssignment(parent) && parent.name === id) return false
      if (ts.isPropertyDeclaration(parent) && parent.name === id) return false
      if (ts.isMethodDeclaration(parent) && parent.name === id) return false
      if (ts.isGetAccessorDeclaration(parent) && parent.name === id) return false
      if (ts.isSetAccessorDeclaration(parent) && parent.name === id) return false
      if (ts.isBindingElement(parent) && parent.name === id) return false
      if (ts.isParameter(parent) && parent.name === id) return false
      if (ts.isVariableDeclaration(parent) && parent.name === id) return false
      if (ts.isFunctionDeclaration(parent) && parent.name === id) return false
      if (ts.isFunctionExpression(parent) && parent.name === id) return false
      if (ts.isClassDeclaration(parent) && parent.name === id) return false
      if (ts.isClassExpression(parent) && parent.name === id) return false
      if (ts.isImportClause(parent)) return false
      if (ts.isImportSpecifier(parent)) return false
      if (ts.isNamespaceImport(parent)) return false
      if (ts.isImportEqualsDeclaration(parent)) return false
      if (ts.isExportSpecifier(parent)) return false
      return true
    }

    let referenced = false
    const visit = (current: ts.Node) => {
      if (referenced) return
      if (ts.isIdentifier(current) && current.text === className && isIdentifierReference(current)) {
        referenced = true
        return
      }
      ts.forEachChild(current, visit)
    }

    for (const member of node.members) {
      if (ts.isConstructorDeclaration(member)) {
        if (member.body) visit(member.body)
        continue
      }
      if (ts.isClassStaticBlockDeclaration(member)) {
        visit(member.body)
        continue
      }
      if (ts.isMethodDeclaration(member) || ts.isGetAccessorDeclaration(member) || ts.isSetAccessorDeclaration(member)) {
        if (ts.isComputedPropertyName(member.name)) {
          visit(member.name.expression)
        }
        if (member.body) visit(member.body)
        continue
      }
      if (ts.isPropertyDeclaration(member)) {
        if (ts.isComputedPropertyName(member.name)) {
          visit(member.name.expression)
        }
        if (member.initializer) visit(member.initializer)
      }
    }

    return referenced
  }

  private getConstructorTemplate(
    node: ts.ClassLikeDeclaration,
    context: EmitterContext,
    isDerived: boolean,
    privateBindings: Map<string, { index: number; kind: 'field' | 'method' | 'accessor' }>,
  ): FunctionTemplate {
    const ctor = node.members.find(member => ts.isConstructorDeclaration(member))
    if (ctor && ts.isConstructorDeclaration(ctor)) {
      return this.buildConstructorTemplate(ctor, context, isDerived, privateBindings)
    }
    return this.buildDefaultConstructorTemplate(context, isDerived)
  }

  private collectMembers(node: ts.ClassLikeDeclaration) {
    const methods: ClassMethodDef[] = []
    const accessors: ClassAccessorDef[] = []
    const fields: ClassFieldDef[] = []
    const staticBlocks: ClassStaticBlockDef[] = []
    const privateBindings: PrivateBinding[] = []

    for (const member of node.members) {
      if (ts.isConstructorDeclaration(member)) continue
      if (ts.isClassStaticBlockDeclaration(member)) {
        staticBlocks.push({ node: member })
        continue
      }
      if (ts.isMethodDeclaration(member)) {
        const isStatic = Boolean(member.modifiers?.some(mod => mod.kind === ts.SyntaxKind.StaticKeyword))
        const isComputed = ts.isComputedPropertyName(member.name)
        if (ts.isPrivateIdentifier(member.name)) {
          privateBindings.push({
            name: member.name.text,
            local: -1,
            isStatic,
            kind: 'method',
            node: member as ts.MethodDeclaration,
          } as PrivateBinding & { node: ts.MethodDeclaration })
        } else {
          methods.push({ node: member, name: member.name, isStatic, isComputed })
        }
        continue
      }
      if (ts.isGetAccessorDeclaration(member) || ts.isSetAccessorDeclaration(member)) {
        const isStatic = Boolean(member.modifiers?.some(mod => mod.kind === ts.SyntaxKind.StaticKeyword))
        const isComputed = ts.isComputedPropertyName(member.name)
        const isSetter = ts.isSetAccessorDeclaration(member)
        if (ts.isPrivateIdentifier(member.name)) {
          privateBindings.push({
            name: member.name.text,
            local: -1,
            isStatic,
            kind: 'accessor',
            node: member,
          } as PrivateBinding & { node: ts.GetAccessorDeclaration | ts.SetAccessorDeclaration })
        } else {
          accessors.push({ node: member, name: member.name, isStatic, isComputed, isSetter })
        }
        continue
      }
      if (ts.isPropertyDeclaration(member)) {
        const isStatic = Boolean(member.modifiers?.some(mod => mod.kind === ts.SyntaxKind.StaticKeyword))
        const isComputed = ts.isComputedPropertyName(member.name)
        if (ts.isPrivateIdentifier(member.name)) {
          privateBindings.push({
            name: member.name.text,
            local: -1,
            isStatic,
            kind: 'field',
          })
        }
        fields.push({ node: member, name: member.name, isStatic, isComputed })
      }
    }

    return { methods, accessors, fields, staticBlocks, privateBindings }
  }


  private buildDefaultConstructorTemplate(context: EmitterContext, isDerived: boolean): FunctionTemplate {
    const bytecode = new BytecodeBuffer()
    const inlineCache = new InlineCacheManager()
    const constantPool = new ConstantPoolManager()
    const ctorContext = new FunctionContext({
      sourceFile: context.sourceFile,
      atomTable: context.atomTable,
      inlineCache,
      constantPool,
      bytecode,
      inFunction: true,
    })

    if (isDerived) {
      ctorContext.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
      ctorContext.bytecode.emitU16(0)
      ctorContext.bytecode.emitOp(Opcode.OP_init_ctor)
      ctorContext.bytecode.emitOp(Opcode.OP_put_loc_check_init)
      ctorContext.bytecode.emitU16(0)
      ctorContext.bytecode.emitOp(Opcode.OP_get_var_ref_check)
      ctorContext.bytecode.emitU16(0)
      ctorContext.bytecode.emitOp(Opcode.OP_dup)
      const label = ctorContext.labels.emitGoto(Opcode.OP_if_false, -1)
      ctorContext.bytecode.emitOp(Opcode.OP_get_loc_check)
      ctorContext.bytecode.emitU16(0)
      ctorContext.bytecode.emitOp(Opcode.OP_swap)
      ctorContext.bytecode.emitOp(Opcode.OP_call_method)
      ctorContext.bytecode.emitU16(0)
      ctorContext.labels.emitLabel(label)
      ctorContext.bytecode.emitOp(Opcode.OP_drop)
      ctorContext.bytecode.emitOp(Opcode.OP_get_loc_checkthis)
      ctorContext.bytecode.emitU16(0)
      ctorContext.bytecode.emitOp(Opcode.OP_return)
    } else {
      ctorContext.bytecode.emitOp(Opcode.OP_push_this)
      ctorContext.bytecode.emitOp(Opcode.OP_put_loc0)
      ctorContext.bytecode.emitOp(Opcode.OP_check_ctor)
      ctorContext.bytecode.emitOp(Opcode.OP_get_var_ref_check)
      ctorContext.bytecode.emitU16(0)
      ctorContext.bytecode.emitOp(Opcode.OP_dup)
      const label = ctorContext.labels.emitGoto(Opcode.OP_if_false, -1)
      ctorContext.bytecode.emitOp(Opcode.OP_get_loc0)
      ctorContext.bytecode.emitOp(Opcode.OP_swap)
      ctorContext.bytecode.emitOp(Opcode.OP_call_method)
      ctorContext.bytecode.emitU16(0)
      ctorContext.labels.emitLabel(label)
      ctorContext.bytecode.emitOp(Opcode.OP_return_undef)
    }
    return {
      kind: 'function',
      name: undefined,
      params: [],
      isArrow: false,
      isAsync: false,
      isGenerator: false,
      bodyText: '',
      bytecode: bytecode.toUint8Array(),
    }
  }

  private buildConstructorTemplate(
    ctor: ts.ConstructorDeclaration,
    context: EmitterContext,
    isDerived: boolean,
    privateBindings: Map<string, { index: number; kind: 'field' | 'method' | 'accessor' }>,
  ): FunctionTemplate {
    const bytecode = new BytecodeBuffer()
    const inlineCache = new InlineCacheManager()
    const constantPool = new ConstantPoolManager()
    const compiler = new BytecodeCompiler({
      atomTable: context.atomTable,
      inlineCache,
      constantPool,
      bytecode,
      expressionStatementDrop: true,
    })
    const ctorContext = new FunctionContext({
      sourceFile: context.sourceFile,
      atomTable: context.atomTable,
      inlineCache,
      constantPool,
      bytecode,
      inFunction: true,
      privateBindings,
    })

    if (isDerived) {
      ctorContext.bytecode.emitOp(Opcode.OP_special_object)
      ctorContext.bytecode.emitU8(OPSpecialObjectEnum.OP_SPECIAL_OBJECT_THIS_FUNC)
      ctorContext.bytecode.emitOp(Opcode.OP_put_loc)
      ctorContext.bytecode.emitU16(0)
      ctorContext.bytecode.emitOp(Opcode.OP_special_object)
      ctorContext.bytecode.emitU8(OPSpecialObjectEnum.OP_SPECIAL_OBJECT_NEW_TARGET)
      ctorContext.bytecode.emitOp(Opcode.OP_put_loc)
      ctorContext.bytecode.emitU16(1)
      ctorContext.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
      ctorContext.bytecode.emitU16(2)
      ctorContext.bytecode.emitOp(Opcode.OP_check_ctor)
    } else {
      ctorContext.bytecode.emitOp(Opcode.OP_push_this)
      ctorContext.bytecode.emitOp(Opcode.OP_put_loc0)
      ctorContext.bytecode.emitOp(Opcode.OP_check_ctor)
    }

    ctorContext.bytecode.emitOp(Opcode.OP_get_var_ref_check)
    ctorContext.bytecode.emitU16(0)
    ctorContext.bytecode.emitOp(Opcode.OP_dup)
    const label = ctorContext.labels.emitGoto(Opcode.OP_if_false, -1)
    if (isDerived) {
      ctorContext.bytecode.emitOp(Opcode.OP_get_loc_check)
      ctorContext.bytecode.emitU16(2)
    } else {
      ctorContext.bytecode.emitOp(Opcode.OP_get_loc0)
    }
    ctorContext.bytecode.emitOp(Opcode.OP_swap)
    ctorContext.bytecode.emitOp(Opcode.OP_call_method)
    ctorContext.bytecode.emitU16(0)
    ctorContext.labels.emitLabel(label)

    if (ctor.body) {
      compiler.compileStatements(ctor.body.statements, ctorContext)
    }

    if (isDerived) {
      ctorContext.bytecode.emitOp(Opcode.OP_get_loc_checkthis)
      ctorContext.bytecode.emitU16(2)
      ctorContext.bytecode.emitOp(Opcode.OP_return)
    } else {
      ctorContext.bytecode.emitOp(Opcode.OP_return_undef)
    }

    return {
      kind: 'function',
      name: undefined,
      params: ctor.parameters.map(param => param.name.getText(context.sourceFile)),
      isArrow: false,
      isAsync: false,
      isGenerator: false,
      bodyText: ctor.body?.getText(context.sourceFile) ?? '',
      bytecode: bytecode.toUint8Array(),
    }
  }

  private buildFieldsInitTemplate(
    fields: ClassFieldDef[],
    context: EmitterContext,
    emitExpression: ClassExpressionEmitterFn,
    options: { isStatic: boolean; privateBindings: Map<string, { index: number; kind: 'field' | 'method' | 'accessor' }>; staticBlocks?: ClassStaticBlockDef[] },
  ): FunctionTemplate {
    const bytecode = new BytecodeBuffer()
    const inlineCache = new InlineCacheManager()
    const constantPool = new ConstantPoolManager()
    const compiler = new BytecodeCompiler({
      atomTable: context.atomTable,
      inlineCache,
      constantPool,
      bytecode,
      expressionStatementDrop: true,
    })
    const initContext = new FunctionContext({
      sourceFile: context.sourceFile,
      atomTable: context.atomTable,
      inlineCache,
      constantPool,
      bytecode,
      inFunction: true,
      privateBindings: options.privateBindings,
    })

    if (!options.isStatic) {
      initContext.bytecode.emitOp(Opcode.OP_special_object)
      initContext.bytecode.emitU8(OPSpecialObjectEnum.OP_SPECIAL_OBJECT_HOME_OBJECT)
      initContext.bytecode.emitOp(Opcode.OP_put_loc1)
    }

    initContext.bytecode.emitOp(Opcode.OP_push_this)
    initContext.bytecode.emitOp(Opcode.OP_put_loc0)

    let brandAdded = false
    for (const field of fields) {
      initContext.bytecode.emitOp(Opcode.OP_get_loc0)
      if (ts.isPrivateIdentifier(field.name)) {
        if (!options.isStatic && !brandAdded) {
          initContext.bytecode.emitOp(Opcode.OP_get_loc0)
          initContext.bytecode.emitOp(Opcode.OP_get_loc1)
          initContext.bytecode.emitOp(Opcode.OP_add_brand)
          brandAdded = true
        }
        initContext.bytecode.emitOp(Opcode.OP_get_var_ref_check)
        initContext.bytecode.emitU16(0)
      } else if (field.isComputed) {
        initContext.bytecode.emitOp(Opcode.OP_get_var_ref_check)
        initContext.bytecode.emitU16(0)
      }

      if (field.node.initializer) {
        emitExpression(field.node.initializer, initContext)
      } else {
        initContext.bytecode.emitOp(Opcode.OP_undefined)
      }

      if (ts.isPrivateIdentifier(field.name)) {
        initContext.bytecode.emitOp(Opcode.OP_define_private_field)
      } else if (field.isComputed) {
        initContext.bytecode.emitOp(Opcode.OP_define_array_el)
      } else {
        initContext.bytecode.emitOp(Opcode.OP_define_field)
        initContext.bytecode.emitAtom(context.getAtom(this.getPropertyName(field.name)))
      }
    }

    for (const block of options.staticBlocks ?? []) {
      compiler.compileStatements(block.node.body.statements, initContext)
    }

    initContext.bytecode.emitOp(Opcode.OP_return_undef)

    return {
      kind: 'function',
      name: undefined,
      params: [],
      isArrow: false,
      isAsync: false,
      isGenerator: false,
      bodyText: '',
      bytecode: bytecode.toUint8Array(),
    }
  }

  private getPropertyName(name: ts.PropertyName | ts.PrivateIdentifier): string {
    if (ts.isIdentifier(name) || ts.isPrivateIdentifier(name)) return name.text
    if (ts.isStringLiteral(name) || ts.isNumericLiteral(name)) return name.text
    throw new Error('')
  }

  private getComputedNameExpression(name: ts.PropertyName | ts.PrivateIdentifier): ts.Expression {
    if (ts.isComputedPropertyName(name)) {
      return name.expression
    }
    throw new Error('')
  }
}

import ts from 'typescript'

import { FOR_OF_NEXT_OPERAND_DEFAULT, JSAtom, JSVarKindEnum, Opcode } from '../env'
import type { EmitterContext } from './emitter'
import type { ExpressionEmitterFn } from './assignment'
import { DestructuringEmitter } from './destructuring'
import { FunctionEmitter } from './functions'
import { ClassEmitter } from './classes'
import { emitAsyncGeneratorReturn } from './async'

export type StatementEmitterFn = (node: ts.Statement, context: EmitterContext) => void

/**
 * 
 *
 * @source QuickJS/src/core/parser.c:6939-7078
 * @see js_parse_statement_or_decl
 */
export class StatementEmitter {
  private loopStack: Array<{ breakLabel: number; continueLabel?: number }> = []
  private destructuringEmitter = new DestructuringEmitter()
  private functionEmitter = new FunctionEmitter()
  private classEmitter = new ClassEmitter()

  private pushLoop(breakLabel: number, continueLabel?: number) {
    this.loopStack.push({ breakLabel, continueLabel })
  }

  private popLoop() {
    this.loopStack.pop()
  }

  private currentLoop() {
    return this.loopStack[this.loopStack.length - 1]
  }

  /**
   * @source QuickJS/src/core/parser.c:7010-7064
   * @see js_parse_statement_or_decl
   */
  emitIfStatement(
    node: ts.IfStatement,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
    emitStatement: StatementEmitterFn,
  ) {
    context.emitSourcePos(node)

    if (!node.elseStatement) {
      const loop = this.currentLoop()
      if (loop && ts.isBreakStatement(node.thenStatement)) {
        emitExpression(node.expression, context)
        context.labels.emitGoto(Opcode.OP_if_true, loop.breakLabel)
        return
      }
      if (loop?.continueLabel !== undefined && ts.isContinueStatement(node.thenStatement)) {
        emitExpression(node.expression, context)
        context.labels.emitGoto(Opcode.OP_if_true, loop.continueLabel)
        return
      }
    }

    emitExpression(node.expression, context)
    const falseLabel = context.labels.emitGoto(Opcode.OP_if_false, -1)
    emitStatement(node.thenStatement, context)
    if (node.elseStatement) {
      const endLabel = context.labels.emitGoto(Opcode.OP_goto, -1)
      context.labels.emitLabel(falseLabel)
      emitStatement(node.elseStatement, context)
      context.labels.emitLabel(endLabel)
      return
    }
    context.labels.emitLabel(falseLabel)
  }

  /**
   * @source QuickJS/src/core/parser.c:6956-6988
   * @see js_parse_statement_or_decl
   */
  emitVariableStatement(
    node: ts.VariableStatement,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
  ) {
    context.emitSourcePos(node)
    const isLexical = Boolean(node.declarationList.flags & (ts.NodeFlags.Let | ts.NodeFlags.Const))
    const isConst = Boolean(node.declarationList.flags & ts.NodeFlags.Const)
    for (const decl of node.declarationList.declarations) {
      const localIdx = (() => {
        if (!context.inFunction || !isLexical || !ts.isIdentifier(decl.name)) return undefined
        const atom = context.getAtom(decl.name.text)
        const scopeLevel = context.scopes.scopeLevel
        if (scopeLevel < 0) return undefined
        const existing = context.scopes.findVarInScope(atom, scopeLevel)
        if (existing >= 0) return existing
        const idx = context.scopes.addScopeVar(atom, JSVarKindEnum.JS_VAR_NORMAL)
        const vd = context.scopes.vars[idx]
        vd.isLexical = true
        vd.isConst = isConst
        return idx
      })()

      if (localIdx !== undefined && (!decl.initializer || ts.isIdentifier(decl.name))) {
        context.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
        context.bytecode.emitU16(localIdx)
      }

      if (decl.initializer && (ts.isObjectBindingPattern(decl.name) || ts.isArrayBindingPattern(decl.name))) {
        this.destructuringEmitter.emitBindingPattern(decl.name, decl.initializer, context, emitExpression)
        continue
      }
      if (!ts.isIdentifier(decl.name)) {
        throw new Error(`: ${ts.SyntaxKind[decl.name.kind]}`)
      }
      const atom = context.getAtom(decl.name.text)
      if (decl.initializer) {
        emitExpression(decl.initializer, context)
        if (ts.isFunctionExpression(decl.initializer) || ts.isArrowFunction(decl.initializer)) {
          context.bytecode.emitOp(Opcode.OP_set_name)
          context.bytecode.emitAtom(atom)
        }
        if (localIdx !== undefined) {
          context.bytecode.emitOp(Opcode.OP_put_loc)
          context.bytecode.emitU16(localIdx)
        } else if (isLexical) {
          context.bytecode.emitOp(Opcode.OP_put_var_init)
          context.bytecode.emitAtom(atom)
        } else {
          context.bytecode.emitOp(Opcode.OP_put_var)
          context.bytecode.emitAtom(atom)
        }
      } else if (localIdx !== undefined) {
        context.bytecode.emitOp(Opcode.OP_set_loc_uninitialized)
        context.bytecode.emitU16(localIdx)
      } else if (isLexical) {
        context.bytecode.emitOp(Opcode.OP_undefined)
        context.bytecode.emitOp(Opcode.OP_put_var_init)
        context.bytecode.emitAtom(atom)
      }
    }
  }

  /**
   * @source QuickJS/src/core/parser.c:7629-7670
   * @see js_parse_statement_or_decl
   */
  emitFunctionDeclaration(node: ts.FunctionDeclaration, context: EmitterContext) {
    context.emitSourcePos(node)
    this.functionEmitter.emitFunctionDeclaration(node, context)
  }

  /**
   * @source QuickJS/src/core/parser.c:7674-7686
   * @see js_parse_statement_or_decl
   */
  emitClassDeclaration(
    node: ts.ClassDeclaration,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
  ) {
    this.classEmitter.emitClassDeclaration(node, context, emitExpression)
  }

  /**
   * @source QuickJS/src/core/parser.c:6898-6932
   * @see js_parse_statement_or_decl
   */
  emitReturnStatement(
    node: ts.ReturnStatement,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
  ) {
    context.emitSourcePos(node)
    if (node.expression) {
      emitExpression(node.expression, context)
      if (context.inAsync && context.inGenerator) {
        emitAsyncGeneratorReturn(context, true)
      } else {
        context.bytecode.emitOp((context.inAsync || context.inGenerator) ? Opcode.OP_return_async : Opcode.OP_return)
      }
    } else {
      if (context.inAsync && context.inGenerator) {
        emitAsyncGeneratorReturn(context, false)
      } else if (context.inAsync || context.inGenerator) {
        context.bytecode.emitOp(Opcode.OP_undefined)
        context.bytecode.emitOp(Opcode.OP_return_async)
      } else {
        context.bytecode.emitOp(Opcode.OP_return_undef)
      }
    }
  }

  /**
   * @source QuickJS/src/core/parser.c:6934-6955
   * @see js_parse_statement_or_decl
   */
  emitThrowStatement(
    node: ts.ThrowStatement,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
  ) {
    context.emitSourcePos(node)
    emitExpression(node.expression, context)
    context.bytecode.emitOp(Opcode.OP_throw)
  }

  /**
   * @source QuickJS/src/core/parser.c:7345-7690
   * @see js_parse_statement_or_decl
   */
  emitTryStatement(
    node: ts.TryStatement,
    context: EmitterContext,
    emitExpression: ExpressionEmitterFn,
    emitStatement: StatementEmitterFn,
  ) {
    context.emitSourcePos(node)

    const catchLabel = context.labels.newLabel()
    const endLabel = context.labels.newLabel()
    const hasCatch = Boolean(node.catchClause)
    const hasFinally = Boolean(node.finallyBlock)
    const finallyLabel = hasFinally ? context.labels.newLabel() : -1

    context.bytecode.emitOp(Opcode.OP_catch)
    context.bytecode.emitU32(catchLabel)

    for (const stmt of node.tryBlock.statements) {
      emitStatement(stmt, context)
    }

    if (hasFinally && finallyLabel >= 0) {
      context.labels.emitGoto(Opcode.OP_gosub, finallyLabel)
    }

    context.bytecode.emitOp(Opcode.OP_nip)
    context.labels.emitGoto(Opcode.OP_goto, endLabel)

    context.labels.emitLabel(catchLabel)

    if (hasCatch && node.catchClause) {
      const innerCatchLabel = context.labels.newLabel()
      const decl = node.catchClause.variableDeclaration
      if (decl && ts.isIdentifier(decl.name)) {
        const atom = context.getAtom(decl.name.text)
        context.bytecode.emitOp(Opcode.OP_put_var)
        context.bytecode.emitAtom(atom)
      }
      context.bytecode.emitOp(Opcode.OP_catch)
      context.bytecode.emitU32(innerCatchLabel)
      for (const stmt of node.catchClause.block.statements) {
        emitStatement(stmt, context)
      }
      context.bytecode.emitOp(Opcode.OP_nip)
      if (hasFinally && finallyLabel >= 0) {
        context.labels.emitGoto(Opcode.OP_gosub, finallyLabel)
      }
      context.labels.emitGoto(Opcode.OP_goto, endLabel)

      context.labels.emitLabel(innerCatchLabel)
      context.bytecode.emitOp(Opcode.OP_throw)
    }

    if (!hasCatch && hasFinally && finallyLabel >= 0) {
      context.labels.emitGoto(Opcode.OP_gosub, finallyLabel)
      context.bytecode.emitOp(Opcode.OP_throw)
    }

    if (hasFinally && finallyLabel >= 0) {
      context.labels.emitLabel(finallyLabel)
      for (const stmt of node.finallyBlock?.statements ?? []) {
        emitStatement(stmt, context)
      }
      context.bytecode.emitOp(Opcode.OP_ret)
    }

    context.labels.emitLabel(endLabel)
