    if (target?.kind === 'pattern' && target.pattern) {
      this.destructuringEmitter.emitBindingPatternFromValue(target.pattern, context, emitExpression)
      return
    }

    if (ts.isVariableDeclarationList(initializer)) {
      const decl = initializer.declarations[0]
      if (!decl) {
        throw new Error(' for-in/of : ')
      }
      if (ts.isIdentifier(decl.name)) {
        const atom = context.getAtom(decl.name.text)
        context.bytecode.emitOp(Opcode.OP_put_var)
        context.bytecode.emitAtom(atom)
        return
      }
      if (ts.isObjectBindingPattern(decl.name) || ts.isArrayBindingPattern(decl.name)) {
        this.destructuringEmitter.emitBindingPatternFromValue(decl.name, context, emitExpression)
        return
      }
      const declKind = (decl.name as ts.Node).kind
      throw new Error(` for-in/of : ${ts.SyntaxKind[declKind]}`)
    }

    if (ts.isIdentifier(initializer)) {
      const atom = context.getAtom(initializer.text)
      context.bytecode.emitOp(Opcode.OP_put_var)
      context.bytecode.emitAtom(atom)
      return
    }

    throw new Error(` for-in/of : ${ts.SyntaxKind[initializer.kind]}`)
  }

  private resolveForInOfTarget(initializer: ts.ForInitializer, context: EmitterContext) {
    if (!ts.isVariableDeclarationList(initializer)) return undefined
    const decl = initializer.declarations[0]
    if (!decl) {
      throw new Error(' for-in/of : ')
    }
    if (ts.isObjectBindingPattern(decl.name) || ts.isArrayBindingPattern(decl.name)) {
      return { kind: 'pattern' as const, pattern: decl.name }
    }
    if (!ts.isIdentifier(decl.name)) {
      const declKind = (decl.name as ts.Node).kind
      throw new Error(` for-in/of : ${ts.SyntaxKind[declKind]}`)
    }

    const atom = context.getAtom(decl.name.text)
    const isLexical = Boolean(initializer.flags & (ts.NodeFlags.Let | ts.NodeFlags.Const))
    const isConst = Boolean(initializer.flags & ts.NodeFlags.Const)
    if (isLexical && context.scopes.scopeLevel >= 0) {
      const scopeLevel = context.scopes.scopeLevel
      const existing = context.scopes.findVarInScope(atom, scopeLevel)
      const localIdx = existing >= 0 ? existing : context.scopes.addScopeVar(atom, JSVarKindEnum.JS_VAR_NORMAL)
      const vd = context.scopes.vars[localIdx]
      vd.isLexical = true
      vd.isConst = isConst
      return { kind: 'loc' as const, localIdx, needsInit: existing < 0 }
    }

    return { kind: 'var' as const, atom }
  }
}

import type { JSAtom, JSVarDef, JSVarScope } from '../types/function-def'
import { JSVarKindEnum } from '../env'

export interface ScopeManagerState {
  vars: JSVarDef[]
  scopes: JSVarScope[]
  scopeLevel: number
  scopeFirst: number
}

/**
 *  QuickJS scope/vars 
 *
 * @source QuickJS/src/core/parser.c:1940-2165
 * @see push_scope
 */
export class ScopeManager {
  readonly vars: JSVarDef[] = []
  readonly scopes: JSVarScope[] = []
  scopeLevel = -1
  scopeFirst = -1

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:2050-2085
   * @see push_scope
   */
  pushScope(): number {
    const scope = this.scopes.length
    this.scopes.push({ parent: this.scopeLevel, first: this.scopeFirst })
    this.scopeLevel = scope
    return scope
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:2097-2120
   * @see pop_scope
   */
  popScope(): number {
    if (this.scopeLevel < 0) return -1
    const current = this.scopeLevel
    this.scopeLevel = this.scopes[current].parent
    this.scopeFirst = this.getFirstLexicalVar(this.scopeLevel)
    return current
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:2127-2165
   * @see add_var
   */
  addVar(name: JSAtom): number {
    const index = this.vars.length
    this.vars.push({
      varName: name,
      scopeLevel: 0,
      scopeNext: -1,
      isConst: false,
      isLexical: false,
      isCaptured: false,
      isStaticPrivate: false,
      varKind: JSVarKindEnum.JS_VAR_NORMAL,
      funcPoolIdx: -1,
    })
    return index
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:2150-2165
   * @see add_scope_var
   */
  addScopeVar(name: JSAtom, varKind: JSVarKindEnum): number {
    const idx = this.addVar(name)
    const vd = this.vars[idx]
    vd.varKind = varKind
    vd.scopeLevel = this.scopeLevel
    vd.scopeNext = this.scopeFirst
    if (this.scopeLevel >= 0) {
      this.scopes[this.scopeLevel].first = idx
    }
    this.scopeFirst = idx
    return idx
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:1944-1951
   * @see find_var
   */
  findVar(name: JSAtom): number {
    for (let i = this.vars.length - 1; i >= 0; i -= 1) {
      const vd = this.vars[i]
      if (vd.varName === name && vd.scopeLevel === 0) return i
    }
    return -1
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:1953-1966
   * @see find_var_in_scope
   */
  findVarInScope(name: JSAtom, scopeLevel: number): number {
    if (scopeLevel < 0) return -1
    let scopeIdx = this.scopes[scopeLevel].first
    while (scopeIdx >= 0) {
      const vd = this.vars[scopeIdx]
      if (vd.scopeLevel !== scopeLevel) break
      if (vd.varName === name) return scopeIdx
      scopeIdx = vd.scopeNext
    }
    return -1
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:1970-1980
   * @see is_child_scope
   */
  isChildScope(scope: number, parentScope: number): boolean {
    let cursor = scope
    while (cursor >= 0) {
      if (cursor === parentScope) return true
      cursor = this.scopes[cursor].parent
    }
    return false
  }

  /**
   *  var
   *
   * @source QuickJS/src/core/parser.c:1983-1998
   * @see find_var_in_child_scope
   */
  findVarInChildScope(name: JSAtom, scopeLevel: number): number {
    for (let i = 0; i < this.vars.length; i += 1) {
      const vd = this.vars[i]
      if (vd.varName === name && vd.scopeLevel === 0) {
        if (this.isChildScope(vd.scopeNext, scopeLevel)) return i
      }
    }
    return -1
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:2087-2096
   * @see get_first_lexical_var
   */
  getFirstLexicalVar(scope: number): number {
    let cursor = scope
    while (cursor >= 0) {
      const first = this.scopes[cursor].first
      if (first >= 0) return first
      cursor = this.scopes[cursor].parent
    }
    return -1
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:2050-2165
   * @see push_scope
   */
  snapshot(): ScopeManagerState {
    return {
      vars: [...this.vars],
      scopes: [...this.scopes],
      scopeLevel: this.scopeLevel,
      scopeFirst: this.scopeFirst,
    }
  }
}

import ts from 'typescript'

import { isDeclarationNode } from './visitor'
import { isDeclarationStatement } from './utils'

export type DispatchHandler<TNode extends ts.Node, TContext, TResult> = (node: TNode, context: TContext) => TResult

/**
 * AST 
 *
 * @source QuickJS/src/core/parser.c:6939-7078
 * @see js_parse_statement_or_decl
 */
export class AstDispatcher<TContext = void, TResult = void> {
  private expressionHandlers = new Map<ts.SyntaxKind, DispatchHandler<ts.Expression, TContext, TResult>>()
  private statementHandlers = new Map<ts.SyntaxKind, DispatchHandler<ts.Statement, TContext, TResult>>()
  private declarationHandlers = new Map<ts.SyntaxKind, DispatchHandler<ts.Declaration, TContext, TResult>>()

  private expressionFallback?: DispatchHandler<ts.Expression, TContext, TResult>
  private statementFallback?: DispatchHandler<ts.Statement, TContext, TResult>
  private declarationFallback?: DispatchHandler<ts.Declaration, TContext, TResult>
  private fallback?: DispatchHandler<ts.Node, TContext, TResult>

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6331-6482
   * @see js_parse_expr
   */
  registerExpression(kind: ts.SyntaxKind, handler: DispatchHandler<ts.Expression, TContext, TResult>) {
    this.expressionHandlers.set(kind, handler)
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6939-7078
   * @see js_parse_statement_or_decl
   */
  registerStatement(kind: ts.SyntaxKind, handler: DispatchHandler<ts.Statement, TContext, TResult>) {
    this.statementHandlers.set(kind, handler)
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6939-7078
   * @see js_parse_statement_or_decl
   */
  registerDeclaration(kind: ts.SyntaxKind, handler: DispatchHandler<ts.Declaration, TContext, TResult>) {
    this.declarationHandlers.set(kind, handler)
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6331-6482
   * @see js_parse_expr
   */
  setExpressionFallback(handler: DispatchHandler<ts.Expression, TContext, TResult>) {
    this.expressionFallback = handler
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6939-7078
   * @see js_parse_statement_or_decl
   */
  setStatementFallback(handler: DispatchHandler<ts.Statement, TContext, TResult>) {
    this.statementFallback = handler
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6939-7078
   * @see js_parse_statement_or_decl
   */
  setDeclarationFallback(handler: DispatchHandler<ts.Declaration, TContext, TResult>) {
    this.declarationFallback = handler
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6939-7078
   * @see js_parse_statement_or_decl
   */
  setFallback(handler: DispatchHandler<ts.Node, TContext, TResult>) {
    this.fallback = handler
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6939-7078
   * @see js_parse_statement_or_decl
   */
  dispatch(node: ts.Node, context: TContext): TResult {
    if (isDeclarationStatement(node) || isDeclarationNode(node)) {
      return this.dispatchDeclaration(node as ts.Declaration, context)
    }
    if (ts.isStatement(node)) {
      return this.dispatchStatement(node, context)
    }
    if (ts.isExpression(node)) {
      return this.dispatchExpression(node, context)
    }
    if (this.fallback) return this.fallback(node, context)
    throw new Error(`: ${ts.SyntaxKind[node.kind]}`)
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6331-6482
   * @see js_parse_expr
   */
  dispatchExpression(node: ts.Expression, context: TContext): TResult {
    const handler = this.expressionHandlers.get(node.kind) ?? this.expressionFallback ?? this.fallback
    if (handler) return handler(node, context)
    throw new Error(`: ${ts.SyntaxKind[node.kind]}`)
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6939-7078
   * @see js_parse_statement_or_decl
   */
  dispatchStatement(node: ts.Statement, context: TContext): TResult {
    const handler = this.statementHandlers.get(node.kind) ?? this.statementFallback ?? this.fallback
    if (handler) return handler(node, context)
    throw new Error(`: ${ts.SyntaxKind[node.kind]}`)
  }

  /**
   * 
   *
   * @source QuickJS/src/core/parser.c:6939-7078
   * @see js_parse_statement_or_decl
   */
  dispatchDeclaration(node: ts.Declaration, context: TContext): TResult {
    const handler = this.declarationHandlers.get(node.kind) ?? this.declarationFallback ?? this.fallback
    if (handler) return handler(node, context)
    throw new Error(`: ${ts.SyntaxKind[node.kind]}`)
  }
}

import ts from 'typescript'

export interface SourceLineCol {
  line: number
  column: number
}

export interface SourceRange {
  start: SourceLineCol
  end: SourceLineCol
}

export interface LineColCache {
  text: string
  bytes: Uint8Array
  ptr: number
  line: number
  column: number
}

/**
 * 
 *
 * @source QuickJS/src/core/parser.c:131-170
 * @see get_line_col
 */
const encoder = new TextEncoder()

const isUtf8Lead = (byte: number): boolean => byte < 0x80 || byte >= 0xc0

export const getLineCol = (source: string, start: number, end: number): SourceLineCol => {
  const bytes = encoder.encode(source)
  return getLineColFromBytes(bytes, start, end)
}

const getLineColFromBytes = (bytes: Uint8Array, start: number, end: number): SourceLineCol => {
  let line = 0
  let column = 0
  const limit = Math.min(end, bytes.length)
  for (let i = Math.max(0, start); i < limit; i += 1) {
    const c = bytes[i]
    if (c === 0x0a) {
      line += 1
      column = 0
    } else if (isUtf8Lead(c)) {
      column += 1
    }
  }
  return { line, column }
}

/**
 * 
 *
 * @source QuickJS/src/core/parser.c:151-193
 * @see get_line_col_cached
 */
export const createLineColCache = (text: string): LineColCache => ({
  text,
  bytes: encoder.encode(text),
  ptr: 0,
  line: 0,
  column: 0,
})

/**
 * 
 *
 * @source QuickJS/src/core/parser.c:151-193
 * @see get_line_col_cached
 */
const getColumnFromLineStart = (bytes: Uint8Array, position: number): number => {
  let column = 0
  for (let i = Math.min(position - 1, bytes.length - 1); i >= 0; i -= 1) {
